INSERT INTO `blogs` VALUES (1,'Colcagro, una apuesta por el agro','Colcagro una App móvil que transforma la manera de hacer negocios agropecuarios.\\n  Nace en Yopal, Casanare, Colombia, gestada por Luis Guillermo Pérez. Ganadero, Zootecnista y Politólogo, quien a través de su experiencia genera una propuesta innovadora que facilita la logística de los negocios agropecuarios, dinamizando y diversificando al sector.\\n  “Espero democratizar el sector y sus negocios al conectar de forma directa a productores y consumidores, así aumentar la cantidad y calidad de los negocios” Pérez(2021).\\n Colcagro se lanza al mercado en Julio de 2021 y busca alcanzar a ganaderos, productores y proveedores de insumos agrícolas, ganaderos, trabajadores, técnicos y profesionales afines al sector, transportadores, y personas del común con interés en los negocios inmobiliarios.',NULL,'https://colcagro.page.link/Qmvy',374,1,2,'2021-07-22 16:20:12','2021-08-13 17:54:02'),(2,'El éxito de la trazabilidad en bovinos','La trazabilidad en los bovinos es un campo poco conocido en las llanuras inundables de los llanos orientales de Colombia, pero con sencillos pasos puede generar un enorme impacto a la eficiencia de la producción bovina y generar mayores rentabilidades.\\n  En algunas zonas de los llanos orientales y el piedemonte llanero, como también, zonas apartadas de Colombia en las cuales se producen con métodos tradicionales de ganadería extensiva, se cuentan con sistemas nulos de rastreo o trazabilidad que garanticen un mejoramiento de distribución genética como tambien consolidación del mejoramiento genético y el hecho de evitar el cruce de consanguinidad entre familiares, son aspectos totalmente olvidados en las diferentes ganaderías del país. Por tal razón, la estructuración e implementación de la trazabilidad favorece por completo la eficiencia exponencial de las producción agropecuarias..\\n  Un ejemplo lo encontramos en la finca los Esteros en jurisdicción de Orocué, Casanare, Colombia. La cual cuenta con un sistema de trazabilidad de más de 14 años, en el cual se ha consolidado los mecanismos de rastreo idóneos para establecer parámetros y condiciones de eficiencia en la fertilidad, crianza, levante y ceba de animales de la raza Brangus, generando excelentes resultados en eficiencia de canal como también en tiempos de preñez. El sistema es muy sencillo, primero que todo debemos aplicar la numeración con número corrido, ya sea con letra o solo numeración rotativa, generando un seguimiento inicial desde el día de nacimiento. Un ejemplo de esta aplicación es el siguiente, Becerra nacida el 1 de enero del 2021, se establece con numeración 100-11 indicando que el animal nació en el mes de enero del año 2021 y compilando la información de la fecha exacta a través de una anotación posterior de esta. Esta numeración puede ir en la oreja izquierda con un tatuaje permanente, no invasivo. Posteriormente con el número de la madre en la oreja derecha, con el ejemplo de 250-56 indicando que su número es el 250 y nació en el mes de mayo del 2016. Con estos simples datos podemos comenzar el rastreo por años de producción los cuales consolidan aspectos de trazabilidad como, edad, números en que el animal quedó preñado o vacío, para temas de sincronización o acondicionamiento nutricional, crías que ha podido levantar con éxito o si este animal posee algún problema de crianza, buena madre o mala, y aspectos genéticos como; propensión genética en distribución de sangre, que en este caso es Brangus ya sea F1-F2 o F3. De tal manera que, nos permitirá el hecho de realizar seguimiento organizado a enfermedades, fertilidad, mortalidad, ganancia de peso y evitar que haya cruces de consanguinidad entre padres e hijas. agregando, claramente, la numeración del padre ya sea en hierro físico o en anotación virtual, esto puede ser con software ganaderos o con un simple excel.\\n En conclusión, un simple método como la trazabilidad de datos en concordancia con aspectos estadísticos de los bovinos permitirá una mejor eficiencia en el descarte fenotípico y genético de bovinos en el hato ganadero, lo cual nos permitirá que por medio de la seleccion, garantizar el mejoramiento y la reproducción de los mejores animales, con aumento de la fertilidad, mejores madres, mayor porcentaje de preñez y docilidad, bastantes aspectos que repercuten en mayores ingresos a futuro.',NULL,'https://colcagro.page.link/FLHr',377,1,2,'2021-07-26 19:13:33','2021-08-06 14:42:37'),(3,'Buenas Prácticas Agrícolas en la protección del Medio ambiente.','De manera histórica, la agricultura ha guardado una estrecha relación con las condiciones medioambientales. Los cambios climáticos, la biodiversidad y otras situaciones conexas,  condicionan la producción agrícola a su éxito o fracaso \\n   Por ello, la mirada de los agricultores gira en torno a la prevención, protección y restablecimiento del medio ambiente, a través de la implementación de  Buenas Prácticas Agrícolas (BPA),  aplicables a la producción, procesamiento, transporte de alimento, orientadas a asegurar la protección de la higiene, la salud humana y el medio ambiente, mediante métodos ecológicamente seguros, higiénicamente aceptables y económicamente factibles (Red de BPA, 2015):\\n  Por tanto, se hacen relevantes algunos aspectos como: \\n  A. Manejo del suelo: Un manejo sostenible del suelo, busca mantener y mejorar sus características naturales a través de técnicas que aseguren la conservación de la fertilidad, minimizando la contaminación y evitando la erosión, la compactación y su salinidad. \\n  B. Sistemas de Riego: El sistema elegido, debe prever el uso racional y eficiente del agua, por ello requiere una planificación correcta evitando los usos excesivos o insuficientes. El exceso de agua puede provocar descenso de oxígeno en el suelo y las plantas, afectando su crecimiento y floración, pudriendo las raíces y más. \\n  C. Gestión de agua y de la energía: Los gastos deben ser documentados y eficientes, evaluando los riesgos de contaminación biológica, química o física potencial, lo anterior considerando características del cultivo y de suelos. \\n D. Manejo de fertilizantes: La elección para su uso debe sustentarse en información específica del lote y del cultivo, por lo que se hace necesario el análisis de foliares del cultivo, para considerar los niveles adecuados de nutrientes y maximizar los beneficios sin degradar el suelo, y evitando posibles contaminaciones. \\n E. Manejo y aplicación de productos Fitosanitarios: Los cuales, si bien permiten hacer un control e impedir el daño que las plagas causa a los cultivos, deben respetar los umbrales y dosis de aplicación establecidas en las etiquetas del producto; haciendo uso eficiente y evitando derivas para el ambiente y la sociedad.\\n   Los anteriores factores conducen al cuidado responsable del medio ambiente, apuntando a reducir el efecto invernadero, a generar una menor cantidad de residuos y a optimizar el uso de la energía y el agua en las producciones agrícolas. \\n El cuidado del medio ambiente, es una apuesta a la seguridad alimentaria y al desarrollo agrícola. \\n Referencias: \\n Red de BPA, (2015). Buenas Prácticas Agrícolas: Lineamientos de Base., Casafe. https://www.casafe.org/pdf/2015/BUENAS-PRACTICAS-AGRICOLAS/BuenasPracticasAgricolas-LineamientosdeBase.pdf.','https://www.youtube.com/watch?v=A83Zc4wr6do','https://colcagro.page.link/xDXz',375,1,2,'2021-07-29 15:14:23','2021-08-06 14:43:09'),(4,'Buenas Prácticas Ganaderas (BPG)','Las Buenas Prácticas Ganaderas (BPG) se refieren a todas las acciones involucradas en el eslabón primario de la ganadería bovina, encaminadas al aseguramiento de la inocuidad de los alimentos carne y leche, la protección del medio ambiente y de las personas que trabajan en la explotación.\\n  En Colombia, el ICA reglamenta estatutos sanitarios de productos de potencial exportador, para lograr la admisibilidad de la carne, leche y sus productos derivados. Mediante Decretos 1500 de 2007 y 616 de 2006, y mediante Resolución 2341 de 2007 y 3585 de 2008.\\n   Verificando aspectos como:\\n 1. Instalaciones pecuarias y Bienestar animal.\\n 2. Alimentación y Medio ambiente.\\n 3. Sanidad animal y Bioseguridad.\\n 4. Uso de medicamentos veterinarios.\\n 5. Saneamiento básico.\\n 6. Transporte.\\n 7. Registro y documentación.\\n 8. Manejo integral de plagas.\\n 9. Almacenamiento de insumos pecuarios y agrícolas.\\n 10. Trazabilidad.\\n 11. Bienestar animal.\\n 12. Personal.\\n 13. Transporte.\\n  Lo anterior, con el objetivo de hacer gestión de riesgos biológicos, físicos y químicos generados en el predio y que pudieran afectar la salud de los consumidores. \\n  Fuente: ICA, 2007.',NULL,'https://colcagro.page.link/9YwG',377,1,2,'2021-07-29 19:11:33','2021-08-06 14:43:22'),(5,'Tierra de sueños y cariños','El campo es un escenario de sueños, una ilusión, un cariño, un pedacito de cielo en la tierra.\\nEl campo está abandonado, para todos no es un secreto, para nadie es un hito. Nuestra historia contempla territorios que no disponen a la necesidad imperante de generar cambios estructurales, estamos condenados a estar dispuestos a congelar el tiempo, a ser reacios a no pensar en una solución, a ver a nuestro alrededor y no vernos a nosotros mismos, ser críticos a los demás, tal vez sea la realidad que nos acoge solemnemente.​​\\nLas soluciones son necesidades del alma, dispuesto a la razón y que involucran el hecho de echar raíces en contexto indispuesto a la identidad necesaria para nuestro desarrollo. Así funciona el campo, y así lo debemos comprender. No es más que un olvido necesario, es una realidad. El campo necesita una política agraria real, que involucre las herramientas necesarias para proveer la infraestructura, la maquinaria y las disposiciones técnicas para generar un impacto a favor de los modelos agrarios comunitarios y familiares, la sostenibilidad, resiliencia y agroecología. Todo en disposición de un campo que piense en los ecosistemas y los biomas de vital importancia para Colombia y el mundo.\\n¿Qué necesita el campo colombiano? ¿Qué nos depara en un futuro cercano?\\nPor Luis Pérez.','https://www.youtube.com/watch?v=tyvxMdiV5kU','https://colcagro.page.link/g7qB',379,1,2,'2021-08-11 11:17:16','2021-10-20 11:01:58'),(6,'Zoocría','La zoocría es la actividad del hombre que involucra el manejo de animales pertenecientes a especies no domésticas, bajo condiciones de cautiverio o semicautiverio, con la finalidad de que a través del mantenimiento, crecimiento o reproducción de los individuos se atiendan demandas humanas o necesidades de la ciencia y de la conservación.1 Los establecimientos donde se realiza la actividad de zoocría se conocen como zoocriaderos.\\nCautiverio y semicautiverio\\nSe habla de cautiverio cuando los animales son mantenidos dentro de espacios cerrados o limitados por barreras físicas, generalmente en densidades superiores a las de las poblaciones silvestres. \\nEn el semicautiverio hay dos variantes:\\nSemicautiverio en baja densidad:\\nlos animales son mantenidos en espacios cerrados por barreras físicas pero en espacios muy amplios y en densidades similares a las de las poblaciones silvestres.\\nSemicautiverio sin barreras:\\nen esta modalidad los animales son mantenidos totalmente libres, sin barreras físicas, pero dependiendo del hombre para su alimentación o reproducción. Generalmente son animales mansos que no saben defenderse por sí solos en el medio natural o están en proceso de adaptación a la vida silvestre.\\nLa zoocría y la domesticación\\nDesde tiempos muy antiguos los hombres iniciaron el proceso de domesticar algunas especies de animales que les eran útiles, ya sea para disfrutar de su compañía o para obtener de ellos alguna ayuda (transporte, caza, leche, carne, huevos, piel). Con el transcurrir del tiempo, la cría y selección dirigida por el hombre produjo cambios genéticos en los animales, que progresivamente se fueron diferenciando de sus congéneres silvestres.\\nEl término ganadería, a diferencia de zoocría, se aplica a las actividades del hombre relacionadas con el manejo de animales pertenecientes a especies domésticas, con fines productivos. Existen, por ejemplo, la ganadería vacuna, bufalina, caballar, asnal, porcina (cerdos), ovina (ovejas), caprina (cabras), aviar (aves de corral), y otras, menos conocidas. Incluso la cunicultura (conejos) y la apicultura (abejas) son actividades ganaderas por definición.\\nObjetivos de la zoocría\\nLa zoocría persigue generalmente uno o varios de los siguientes objetivos:\\nObtención de productos y subproductos de especies no domésticas, tales como carne, pieles, huevos, pelo o plumas.\\nProducción de animales vivos para mascotas, para la cacería deportiva, para otros zoocriaderos o zoológicos o para programas de conservación.\\nGenerar beneficios económicos.\\nFunciones de la zoocría para la conservación\\nMuchos animales que se encuentran en peligro de extinción son cuidados y criados en zoocriaderos con el fin de reproducirlos y estudiar más su comportamiento y biología. Sin embargo, es importante tener presente que a veces estos factores podrían variar por el mismo hecho de estar en cautiverio. Es estos casos, cuando se trata de zoocriaderos con fines de conservación de la especie, es condición fundamental que el manejo en general, especialmente la alimentación, sean lo más similar posible a los que el animal encontraría en estado silvestre.\\nLa zoocría puede cumplir con varias funciones útiles e importantes para la conservación de las especies que son manejadas, como son:2\\nProducción de individuos para repoblación, reintroducción o refrescamiento de sangre en poblaciones disminuidas o amenazadas de extinción.\\nMantenimiento de especie cuyos hábitats naturales han sido degradados o ya han desaparecido y no tienen oportunidad en corto plazo de sobrevivir en poblaciones libres.\\nDesarrollo de investigaciones sobre la biología y manejo de especies animales.\\nDisminución de la presión de extracción sobre poblaciones sometidas a la caza al abastecer parte de la demanda con los productos obtenidos y comercializados legalmente en los zoocriaderos.\\nEducación y sensibilización de los niños y del público en general hacia la conservación de las especies animales a través de las visitas a los zoocriaderos y zoológicos.\\nProductividad en la zoocría\\nEn todo zoocriadero ocurren tres procesos que van facilitando el mejoramiento progresivo de la productividad: \\n1. Los animales se van acostumbrando o aclimatando a las condiciones de alojamiento (instalaciones) y manejo (alimentario, reproductivo y sanitario) del zoocriadero. 2. Las personas encargadas del manejo de los animales en el zoocriadero van aprendiendo a darles cada vez mejor manejo, y se van desarrollando nuevas técnicas de manejo o mejorando las existentes para que los animales estén en mejores condiciones y puedan desarrollar su potencial reproductivo y de crecimiento. 3. La «selección natural» que ocurre dentro del zoocriadero opera a favor de la adaptación genética de los animales a sus condiciones de manejo y ello permite que generación tras generación los animales vayan logrando mejores índices reproductivos y de crecimiento (productividad).\\nEspecies\\nEntre las especies que más se utilizan en zoocriaderos están los cocodrilos (Crocodylus acutus y Crocodylus intermedius), las iguanas (Iguana iguana), las hicoteas (Trachemys callirostris), las mariposas (Ascia monuste), los chigüires (Hydrochoerus hydrochaeris), los picures o ñeques (Dasyprocta spp.),3 las boas, las psitácidas, y muchas otras.\\nAlgunos de estos zoocriaderos son de fines comerciales, otros son de fines de conservación de la especie y algunos cumplen con ambos propósitos.\\nPara desarrollar la zoocría debe conocerse la biología de la especie a criar lo mejor posible, para poder imitar sus condiciones en cautiverio y aplicar las mejores técnicas de manejo en bien de la productividad, sin afectar el bienestar de los animales. Según sea la especie a criar, variarán los requerimientos de infraestructura y el espacio necesario para los animales.\\nBibliografía\\n1.GONZÁLEZ-FERNÁNDEZ, A.J. 2011. La Zoocría.UNELLEZ, Guanare, Venezuela. Material didáctico. 29 pp.\\n2.SOULÉ, M.E. and B.A. WILCOX. 1980. Conservation Biology: An volutionary-Ecological Perspective. Sunderland, Massachusetts. 395 pp.\\n3.GONZÁLEZ-FERNÁNDEZ, A.J. 2011. Zoocría de Picure (Dasyprocta spp.). UNELLEZ, Guanare, Venezuela. Material didáctico. 15 pp.\\nVideo de propiedad del instituto agropecuario Colombiano ICA.','https://www.youtube.com/watch?v=uIv4XpP3dPI','https://colcagro.page.link/NF5Z',376,1,2,'2021-08-11 11:17:17','2021-10-14 17:03:41'),(7,'Una carta para muchos que interesa a pocos','Una carta para muchos que interesa a pocos\\nPor Luis Pérez, \\nEn esta ocasión la razón fundamental para escribir recae en la necesidad imperante de contar a los vividos lectores, el propósito de estar llevando a cabo un proyecto como Colcagro. Me acuerdo de la escritura de Rainer Maria Rilke cuando se refiere a Ewald como un alma dispuesta por Dios para escuchar y comprender, pero sobre todo, sentir. Así es, un alma postrada en silla de ruedas, pero más sensible que cualquiera de nosotros.\\nColcagro es una App móvil que busca unificar bienes y servicios en todo el campo colombiano, es una pieza estructurada en una Agrotech que permite desde una App conectar productores con consumidores, así es, elimina los intermediarios y genera mayor dinamismo en los negocios agropecuarios, sin contar el sin fin de beneficios para nuestro querido campo. Desde proteger el valor agregado en las producciones, evitar la pérdida de productos perecederos, combatir la especulación, generar mayor seguridad en los negocios, organizar a los productores, proporcionar herramientas para concientizar la resiliencia y sostenibilidad de los ecosistemas, brindar contenidos científicos jurídicos que respalden el cambio e impacto del ser humano en los ecosistemas, impactar aspectos claves para nuestros país, desde la historia, la poesía, la cultura e incluso un prefacio para los niños, con cuentos, ideas que los invita a soñar. Continuamos con la posibilidad de visualizar los cultivos a nivel internacional, conectar el mercado local con el regional, nacional e internacional, prever la integración de inteligencia artificial para los procesos de comercialización y comprobación de calidad, ya sea en animales o vegetales, y miles de posibilidades que ya están, en la cabeza, en el papel o en la realidad, cualquiera de las 3, pero que las tenemos contempladas. Cada engranaje está pensado para ayudar a impulsar el sector más olvidado de Colombia.\\nTodo suena maravilloso, pero he aquí el problema, las personas, en la mayoría de los casos se han dispuesto a no curiosear, ni siquiera a especular, a nada. Así es, más de lo mismo, a pesar de que hemos contado con un crecimiento orgánico favorable, las cosas se presentan en un panorama bastante complicado y es indiscutible que proyectos de este estilo no sobreviven solo con descargas. Los días pasan y más me doy cuenta que mi hipótesis era verdad, nadie le apuesta al campo y mucho menos, a los jóvenes que aún creen en este. Los miles de obstáculos lo comprueban, la política, el gobierno, los bancos y muchos entes privados o públicos que han cerrado la puerta para un mejor futuro para el campo, pero, no es solo para el campo, es para todos.\\nAún estamos en pie de lucha, sin ganas de desfallecer, pero estos ejercicios retroalimentativos son importantes para el quehacer del típico emprendedor colombiano.  En un país lleno de conformismo, de inequidad, de miseria, educación, salud y herramientas para querer transformar miles de hectáreas llenas de cicatrices y sangre.\\nEl fin está claro, por eso; “Lo auténtico permanece inmortal ante la posteridad” Johann Wolfgang von Goethe.\\nLa pintura se llama; La muerte de Marat de Jacques-Louis David, Año 1793.',NULL,'https://colcagro.page.link/KZcz',379,1,2,'2021-08-11 11:18:26','2021-10-18 17:21:38'),(8,'Trabajo de Llano: Tradición y cambio','El presente artículo está inspirado por los aportes de Hernan Zuluaga Albarracin con la academia de historia de Casanare.\\nExisten cosas indispensables en la vida de un ser humano, unas más que otras. La historia es sin duda alguna, una de las más importantes, por el hecho de permitirnos trascender del olvido. Luis Pérez.\\nNos complace iniciar los artículos históricos por parte del Centro de historia de Casanare, con el propósito de extender la hermosa tarea académica y metodológica que han realizado por años, y brindar al conocimiento del campo colombiano tan bello trabajo.\\nLa historia del llano es poco conocida, solo nos adentramos en los hechos más relevantes y las consecuencias que importen dichos hechos, más la profundidad del ejercicio y la importancia de la noción de identidad y el reconocimiento como política, he aquí un material que brinda una luz a nuestras raíces como llaneros y colombianos.  El trabajo de llano es mucho más que un simple ejercicio laboral, es una faena que se desarrolla en un teatro maravilloso, con roles determinados y con propósitos culturales que determinan las bases de identidad de miles de llaneros. Según el autor, el trabajo de llano es; “conocer el llano para poder ejercer algún tipo de práctica económica con el fin de subsistir en el; sembrar un conuco, pescar, derribar y conocer el tipo de maderas de los árboles para sacar provecho de ellas, ir de cacería o marisca y, por supuesto, montar en caballo y lidiar con el ganado vacuno. Es decir, todas las actividades que se realizan en el llano son consideradas por los llaneros trabajo de llano. Pero, el trabajo de llano tiene un sentido restringido y es el que se refiere al conjunto de trabajos que tienen relación con la recolección, aparte y posterior hierra de los ganados vacunos. En otras palabras, el trabajo de llano es trabajo de vaqueria”. (C. H. Casanare. 1992. pp 209).\\nCabe resaltar, que en aquellos tiempos de los años 50 se tenía una posesión muy por encima sobre el tema de la tierra, era una situación más dada a las sabanas comunales, sin cercas, o medios para controlar el ganado en grandes encerrados, solo había referencia de puntos representativos en los escenarios naturales de las sabanas, dicho de otra manera, la sabana era de todos y a las vez de nadie. Esto brindaba la atención de otorgar cierta ley aceptada bajo los pretextos de la comunidad, como lo afirma el autor; “La ley del llano, que era una especie de derecho consuetudinario, contenía normas sobre el acceso a los ganados cimarrones, cachilapos y orejanos, es decir, sobre los ganados sin marca en la oreja y sin hierro, libres; dicha ley establece que el que enlazara y marcará en la oreja quedaba automáticamente de propietaria de estos animales”. (Ibid, 1992).\\nEste escenario corresponde a comunidades que interactúan bajo preceptos de respeto, hacer valer la palabra y valores familiares. El llano desarrolla mecánicas de usufructo personal en la tierra, bajo mandato social y con la obligación de trabajo mancomunado para conformar grandes ganaderías.\\nA continuación citamos el texto de Hernan Zuluaga; “La jornada se iniciaba a las tres o cuatro de la madrugada, hora en que tocaba levantarse para ir a buscar las bestias y remontarse; los caballos se encerraban desde la noche anterior en el corral o en los potreros aledaños al hato; se nombraba un caballicero grande que era la persona encargada de cuidar y asignar a cada uno las bestias que los vaqueros iban a montar mientras durara el trabajo de llano; “y allá en el corral, pues, marcaban todos los protones, cualquier bestia y se lo nombraban a uno a fulano de tal, “fulano tome este caballo ensillado”.\\nA cada vaquero le tocaban cuatro o cinco caballos, le daban dos protones, caballos sin domar completamente, y tres caballos mansos.\\nSe salía a recoger el ganado sin haber probado alimento; “tocaba salir con el solo tinto”.\\nYa en la sabana el objetivo era reunir el ganado que se pudiera sacándolo de las matas de monte y formando un rodeo en la sabana abierta; se encerraba con los caballos con el fin de arrearlos hasta el corral; al decir de un llanero, la formación del rodeo era parte fundamental en el trabajo de llano; “el ganado ya como esa vez, antiguamente, [en] la sabana no se tiraba una cuerda de alambre, era suelto todo; entonces para ir a agarrar un rodeo de trescientas reses había que darle pata al caballo, entonces ahí se reunía el trabajo e llano, pa coger el ganado porque como era escueto todo, entonces era pa, o sea, la gente era pa coger el ganado y no dejarlo ir\\nLos ganados criollo o casanare eran las razas predominantes; sus características más sobresalientes eran: poca alzada, gran cornamenta y su gran resistencia al medio de los llanos. Ganado que al permanecer la mayor parte del tiempo en las sabanas adquiere poca docilidad, característica que los hacía muy buenos para el “coleo”, “por lo que era bravo, ese si era muy “mañoso” y bravo y corría muy bueno pa “bailarlo… le daban a lo bruto”. (Ibid, 1992).\\nLas vivencias del llano son una muestra del arraigo del trabajo, de la fuerza de los seres humanos para construir un mundo único a nivel cultural, social y económico. El llano es más que una zona geográfica, es un paraíso en la tierra.\\nPara conocer un poco más del material académico recopilado por el centro histórico de Casanare se pueden comunicar al siguiente correo: educa@colcagro.com.co\\nBibliografía\\nCentro de historia de Casanare. (1992) Llano adentro: del pasado al presente. Editorial de la universidad Pedagógica. pp 262. \\n  Video propiedad de Señal Colombia.','https://www.youtube.com/watch?v=zi7BsnF8U8c','https://colcagro.page.link/83P4',381,1,2,'2021-08-11 11:33:58','2021-10-27 18:43:29'),(9,'GrowBank','Nosotros\\nSomos una firma de consultoría financiera que presta servicios de banca de inversión para el sector Agroindustrial. Creemos firmemente en la transformación del campo y la creación de negocios cada vez más sostenibles y con impacto en nuestras comunidades. El equipo de asociados tiene más de 25 años en el sector financiero, tanto en la originación de operaciones, como en la consolidación y éxito de las mismas. \\nDedicados al agro\\nSomos la primera Banca de Inversión en Colombia, dedicada exclusivamente al desarrollo de la industria Agrícola. \\nAliado Financiero\\nIntervenimos en el desarrollo de decisiones estratégicas que generan rentabilidad en la operación. \\nMuy pronto conocerás más de nosotros.','https://growbank.com.co','https://colcagro.page.link/Xud3',393,1,2,'2021-08-12 12:29:56','2021-10-27 19:14:25'),(19,'AGROECOLOGÍA','La agroecología es «la ciencia, el movimiento y la práctica»1 de la aplicación de los procesos ecológicos en los sistemas de producción agrícola, pecuaria y forestal, así como en los sistemas alimentarios. La agroecología se basa en la aplicación de principios que combinan valores ecológicos y sociales, cuya aplicación se adapta a distintos contextos socio-ecológicos y también a distintas escalas, desde la muy pequeña para el autoconsumo hasta la gran escala, incluyendo el nivel de paisaje. La agroecología tiene como principio fundamental la diversificación biológica y a partir de ella es posible el restablecimiento y fortalecimiento de las funciones ecológicas que mantienen la resiliencia ecológica y social de los sistemas productivos. Los procesos ecológicos y sociales que desencadena la producción agroecológica la posicionan como una estrategia para el cambio transformativo en la alimentación sustentable,2 incluyendo en crisis contemporáneas como pandemias.3 \\nFundamentos de aplicación \\nEl enfoque de la agricultura convencional siempre ha buscado incrementar la producción de cosechas agrícolas sin considerar las consecuencias posteriores sobre el ambiente en el que se practica. Así ocurre, por ejemplo, con la labranza intensiva del suelo, práctica de monocultivo, uso indiscriminado de fertilizantes sintéticos, el control químico de plaga y arvenses, uso intensivo de agua de pozos profundos para la agricultura y la manipulación genética, entre otras prácticas de la agricultura moderna. \\nAnte los múltiples factores negativos de la agricultura convencional, emerge la concepción de la agroecología, y la tecnología de la agricultura ecológica, que promueve la producción agrícola conservando los recursos naturales elementales de la producción de alimentos tales como el suelo, agua y biodiversidad. Estas acciones se basan en el respeto a las comunidades rurales (quienes aportan el material genético mejor adaptado a las condiciones locales) y a los principios éticos y humanos en la realización de estas actividades. La agricultura ecológica, como puesta en práctica de la ciencia agroecológica, puede ser altamente productiva y a su vez sostenible en producción y conservación a largo plazo con la finalidad de poder solventar el abastecimiento de alimentos a una creciente población humana.\\nEn esta perspectiva, el diseño y manejo de agroecosistemas sostenibles no puede ni debe abandonar las prácticas convencionales sino que debe considerar las prácticas tradicionales para justificar su sostenimiento. Se trata de diseñar científicamente nuevas concepciones y tecnologías agrícolas, sobre la base de los métodos y conocimientos ecológicos actuales y los principios tradicionales de conservación de los recursos naturales que muchas comunidades rurales tienen y en las que cubren sus necesidades alimentarias sin requerir grandes insumos externos en su ciclo productivo. En concordancia con esto Gliessman menciona que La agroecología debe integrar ciencia, tecnología y práctica, y los movimientos para el cambio social.4\\nPrincipios agroecológicos \\nLa agroecología no facilita recetas, ni paquetes técnicos, ni normas, ni prescripciones. Se basa en la aplicación de cinco principios básicos:5 reciclaje, eficacia, diversidad, regulación y sinergias. La elección de las prácticas de gestión y de las tecnologías para la aplicación de estos principios es siempre específica al lugar, determinada por un contexto socioecológico concreto. La falta de normas y sistemas de certificación diferencia a la agroecología de la agricultura orgánica. \\nAdaptabilidad: que consiste en no modificar el sitio de cultivo para tratar de satisfacer las necesidades de las especies, sino, usar una estrategia de adaptación del potencial biológico y genético de estas a las condiciones del lugar. \\nReciclaje natural: para asegurar condiciones de suelo favorables aumentando la actividad biótica, la disponibilidad y aporte de nutrientes y la retención de humedad, a través del manejo de la materia orgánica, reciclado de biomasa y aumento de la cobertura. \\nPreservación: para asegurar mucho más la salud del agroecosistema en su totalidad, que el producto de un sistema de cultivo en particular. Aumentando las interacciones biológicas y las sinergias entre los componentes de la biodiversidad promoviendo procesos y servicios ecológicos claves.\\nRacionalidad tecnológica: para eliminar progresivamente el uso de insumos externos sintéticos que tienen el potencial de dañar el ambiente, e ir hacia el uso de insumos de origen natural y fuentes renovables de energía, tanto para el aporte nutricional como para el manejo de plagas, enfermedades y arvenses.\\nRestauración Ecológica: según la Sociedad Internacional para la Restauración Ecológica, consiste en «asistir a la recuperación de ecosistemas que han sido degradados, dañados o destruidos, en la agroecología se puede utilizar técnicas que ayuden a recuperar espacios que fueron dañados por la agricultura convencional los cuales utilizaron agroquímicos, usando la ciencia como parámetro principal buena labranza, abonos orgánicos, simbiosis entre plantas.\\nBibliografía\\n1.Wezel, A., Bellon, S., Doré, T., Francis, C., Vallod, D., David, C. (2009). Agroecology as a science, a movement or a practice. A review. Agronomy for Sustainable Development./n2.Anderson, Colin Ray; Bruil, Janneke; Chappell, Michael Jahi; Kiss, Csilla; Pimbert, Michel Patrick (25 de septiembre de 2019). «From Transition to Domains of Transformation: Getting to Sustainable and Just Food Systems through Agroecology». Sustainability (en inglés) 11 (19): 5272. ISSN 2071-1050. doi:10.3390/su11195272. Consultado el 19 de julio de 2020. \\n3.Altieri, Miguel A.; Nicholls, Clara I. (2 de julio de 2020). «Agroecology and the reconstruction of a post-COVID-19 agriculture». The Journal of Peasant Studies (en inglés): 1-18. ISSN 0306-6150. doi:10.1080/03066150.2020.1782891. Consultado el 19 de julio de 2020. \\n4.«International Symposium on Agroecology for Food Security and Nutrition | Food and Agriculture Organization of the United Nations». www.fao.org. Consultado el 3 de junio de 2021.\\n5.Altieri, Miguel A. (2004-02). «Linking ecologists and traditional farmers in the search for sustainable agriculture»]. Frontiers in Ecology and the Environment 2 (1): https://esajournals.onlinelibrary.wiley.com/doi/full/10.1890/1540-9295%282004%29002%5B0035%3ALEATFI%5D2.0.CO%3B2 . Consultado el 3 de junio de 2021.',NULL,'https://colcagro.page.link/j3qF',380,1,2,'2021-10-14 10:42:21','2021-10-14 11:03:32'),(20,'El Seguro Bovino y Bufalino','Asegura el bienestar de cada animal existente en tu hato ante cualquier enfermedad (establecidas dentro del condicionado), la ocurrencia de algún evento climático, o accidentes que diezmen el número de bovinos o búfalos a tu cuidado, así evitarás la pérdida considerable de una buena producción. \\n  Protege a tus bovinos y búfalos ante ciertos factores que pueden afectar a estas especies, así, estás preparado y cuentas con todo el apoyo ante diferentes factores que pueden afectar a tu negocio. Asegura tu hato con SURA y respalda el bienestar de tus animales. \\n Con el Seguro Bovino y Bufalino tú puedes: \\n    Recupera los costos invertidos en tu hato ganadero. \\n    Cuenta con respaldo para responder por tus obligaciones financieras. \\n    Obtén el subsidio de Finagro para el pago de una parte de tu seguro. \\n    Continua con tu actividad agropecuaria y vigencia en el mercado ante afectaciones generadas por eventos climáticos y naturales. \\n   Tipo de explotación protegida: \\n •  Ganadería de carne\\n • Ganadería de leche\\n • Ganadería de doble propósito\\n Si tienes dudas sobre alguno de nuestros productos, comunícate a nuestra línea de atención nacional 01 8000 051 8888 o marca gratis desde tu celular al #888. \\n ¿Cuál es el valor asegurado por hato? \\n Corresponde a la suma de los valores asegurados de cada uno de los animales que integran el hato ganadero. Por ejemplo, el valor asegurado del animal es de $ 2.000.000 multiplicado por 200 animales que integran el hato ganadero, el valor asegurado es de $ 400.000.000. \\n ¿Qué no cubrimos? \\n Las pérdidas que sean consecuencia directa o indirecta de los siguientes hechos no están contempladas por el seguro: \\n • Atollamiento de los animales en cuerpos de agua. \\n •  Lesiones en los animales por descuido, tratamientos médicos incorrectos o la realización de prácticas de manejo inadecuadas. \\n •  Fusil sanitario de los bovinos y bufalinos por orden del ICA a causa de eventos no cubiertos. \\n • Procesos experimentales o de ensayo a los que se someten los animales. \\n  ¿Qué personas y organizaciones se pueden asegurar? \\n •  Ganaderos: personas naturales que sean propietarias de un hato ganadero. \\n •  Asociaciones, distribuidores agropecuarios, cooperativas, federaciones, entidades financieras, entre otras colectividades. \\n ¿Qué pasa cuando solicitas el seguro? \\n Seguros SURA recibe tu solicitud, que incluye una declaración de asegurabilidad y demás soportes que te pidan. La aceptación del riesgo está sujeta a análisis. Para más información, comunícate con tu asesor o envía un mensaje al correo suscrip.agro@suramericana.com.co. \\n Aprovecha el subsidio Finagro para pagar tu seguro\\n El Fondo para el Financiamiento del Sector Agropecuario (Finagro) es la institución del Estado que se encarga de administrar los recursos destinados a apoyar el desarrollo del campo y la producción agrícola. \\n Si decides tomar uno de nuestros seguros, tendrás acceso al incentivo para el pago de la prima que SURA gestionará con Finagro directamente. \\n Las condiciones para el otorgamiento del subsidio son de acuerdo a lo estipulado en la resolución vigente que aplique al momento de la suscripción de tu seguro. \\n Requisitos: \\n •  Registro de vacunación del ICA. \\n • Registro de predio ganadero ante el ICA. \\n •  Pertenecer o estar registrados en asociaciones, agremiaciones, cooperativas, o cualquier tipo de comités o agrupamiento formal de productores, bien sea del orden nacional, regional o local. \\n     ¿Cuál es la tarifa del Seguro? \\n La tarifa del seguro se calcula de acuerdo con las condiciones de hato ganadero, el sistema de producción, la zona y la declaración de asegurabilidad, entre otras variables. \\n ¿Cómo hacer una reclamación? \\n Si un evento cubierto por el seguro afectó a tu hato, debes seguir este procedimiento: \\n •  Notifica lo ocurrido inmediatamente o máximo tres días después de evidenciar los daños en la línea nacional 01 8000 051 8888, al #888 sin costo desde tu celular o, si estás en Medellín, Bogotá o Cali, llama al 437 88 88. Por estos medios se te informa cuáles son los documentos que debes presentar para sustentar la reclamación. \\n •  Nosotros programamos una visita de verificación por parte de un ajustador a su explotación del hato. \\n •  Seguros SURA te indemniza al mes siguiente de haber demostrado la ocurrencia y cuantía del hecho. \\n Plazos y términos\\n •  Este seguro está disponible para cualquier zona de Colombia. \\n •  Este seguro tiene una vigencia anual, sin renovación automática. \\n •  Se cumplirá la terminación de este seguro en caso de: \\n o Mora en el pago del seguro. \\n o En caso de que SURA decida realizar la terminación del contrato, se te informa por escrito con diez días de anticipación y se te devuelve el valor de lo que pagó, de aucerdo con el tiempo cubierto por el seguro. \\n o Si deseas cancelar el seguro: debes solicitarlo por escrito al correo suscrip.agro@suramericana.com.co y se te devuelve la cantidad de dinero que pagó correspondiente al tiempo que no tuvo cobertura. \\n','https://www.youtube.com/watch?v=05WrfbQ4_zw&ab_channel=SegurosSURAColombia','https://colcagro.page.link/2deL',393,2,2,'2021-10-15 11:48:40','2021-10-19 15:36:08'),(21,'Colsemillas','Un nuevo propósito\\nUna nueva marca llega para impulsar el campo\\nSomos distribuidores a nivel nacional de las mejores referencias de semillas.\\nNuestros productos\\nPastos tropicales\\nMaíz híbrido\\nhortalizas\\nFrutales\\nAromáticas','https://colsemillas.com','https://colcagro.page.link/bUJD',393,1,2,'2021-10-27 20:32:53','2021-10-27 20:32:54'),(22,'Academia de Historia de Casanare','Somos aliados para subir contenidos al blog educativo de Colcagro, en pro del conocimiento y la historia de los llanos colombianos.',NULL,'https://colcagro.page.link/k8nW',393,1,2,'2021-10-27 20:45:20','2021-10-27 20:45:22'),(23,'Sosty - Neoganadería','Sosty es una plataforma colaborativa que permite a consumidores convertirse en ganaderos digitales conectándose con ganaderos sostenibles para que puedan invertir en ganado desde bajos montos, sin necesidad de tener una finca o conocimientos especializados en ganadería. \\n  En Sosty encontramos dos problemáticas: Por un lado, una imagen no muy popular de la ganadería, con un gran distanciamiento entre productores y consumidores. Por otro lado, encontramos que invertir en proyectos del sector real no es tan fácil: usualmente requiere alto capital, alta disponibilidad de tiempo y tener conocimientos especializados en el sector donde estas invirtiendo. \\n Queremos crear un cambio en la manera como funciona nuestro sistema alimentario y solucionar estas dos problemáticas conectando las dos puntas, para que entre productores y consumidores podamos impulsar la producción de alimentos naturales y sostenibles, que no deforesten, no dependan de agroquímicos, capturen carbono, tengan bienestar animal y a su vez permitan democratizar la participación para invertir en ganadería, generando rentabilidad y una gran comunidad de productores y consumidores sostenibles. \\n ¿Cómo funciona? \\n Sosty es una plataforma digital que permite hacer esto posible, realizamos un proceso de selección de productores que realizan buenas practicas, no tengan problemas de antecedentes, no presenten deforestación y cuenten con los pastos, conocimientos e infraestructura suficiente para realizar el proyecto. Luego, el proyecto es aprobado por el equipo técnico de Sosty y queda disponible para que los ganaderos digitales o inversionistas puedan aportar desde 100 kilogramos a la manada de animales que se compraran y se llevaran al proyecto. \\n El equipo de Sosty se encarga de comprar en nombre de los ganaderos digitales el ganado, seleccionarlo, transportarlo, marcarlo e identificarlo y contratar una póliza de seguro para los animales una vez lleguen al predio del productor quién se encargara de engordarlos, realizando buenas prácticas y compartiendo información del proyecto como fotos, videos y pesajes de los animales a cambio de una comisión por su gestión. Sosty sera el coordinador del proyecto y lo acompañara hasta su finalización una vez alcance su peso objetivo, donde el proyecto se liquidará y se repartirán las utilidades de acuerdo a la participación de los ganaderos digitales. \\n  ¿Qué hemos logrado? \\n En cuatro meses hemos logrado alcanzar 100 ganaderos digitales quienes han invertido más de 200.000 USD y cuentan con alrededor de 500 animales engordando en diferentes fincas que no tienen deforestación y adicionalmente promueven la ganadería regenerativa, la cual está basada en mejorar las condiciones del suelo, imitando los procesos de la naturaleza con animales en manada quienes a través de rotaciones de pastos, y sin el uso de agroquímicos, permiten que estos se regeneren, promuevan la vida del suelo y la regeneración de nuevas pasturas. \\n  El equipo \\n Somos un equipo integral, negocios, operación, y tecnología, con un propósito en común: Transformar con tecnología la forma como se relacionan los productores y consumidores de nuestro sistema alimentario y promover la producción de alimentos naturales y sostenibles. Estamos convencidos de que con mucho esfuerzo podremos llegar a conseguir a millones de personas en Latam dispuestas a invertir y promover la producción de alimentos sostenibles para todos. \\n  Manuel Gutiérrez -CEO & Co-founder \\n Disney Baquero - COO & Co-founder \\n Camilo Velasco- CTO & Co-founder \\n','https://sosty.co/','https://colcagro.page.link/e126',393,1,2,'2021-11-12 11:14:40','2021-11-12 11:14:41'),(24,'Y tú, ¿quieres saber la verdad?','La comisión de la verdad es una institución colombiana que busca contar la verdad del conflicto armado en Colombia, por esta razón, Colcagro se une a la necesidad imperante de mostrar la verdad de millones de personas que sufrieron el conflicto en Colombia.\\nY tú, ¿quieres saber la verdad?\\nÉl es Humberto. Durante mucho tiempo conocido como Gamboa, su alias, su nombre de guerra, desde muy joven renunció a su aspiración de ser veterinario y empuñó las armas para vengar la muerte de su hermana. Hoy reconoce que fue la peor decisión de su vida porque no le devolvió a su ser querido y sí le arrebató los suyos a otras personas. Quiere contarlo todo. Pedir perdón. Ayudar a reparar en algo a quienes sufrieron por sus acciones y tal vez algún día convertirse en veterinario\\nElla es Luisa. Su madre murió poco después de que su padre fue desaparecido por un grupo armado de Nunca se volvió a saber nada, pero tiene intacto su recuerdo. Vive con sus hermanos menores a las afueras de un pueblo. Desde muy pequeña ama leer nos llevará. Es el alma de la familia y en las noches aprende sobre leyes porque cree en la justicia y quisiera ser abogada. Estos dos colombianos han encontrado la oportunidad de estar más cerca. Humberto tiene una verdad por contar para encontrar la tranquilidad que perdió.\\nLuisa quiere escuchar la verdad. Saber qué pasó con su padre y perdonar. Ambos necesitan la verdad para sanar, para cumplir sus sueños, para avanzar hacia una Colombia en paz. Y tú quieres saber la verdad? Comisión de la verdad.\\nPropiedad de la comisión de la verdad para todos los colombianos.','https://www.youtube.com/watch?v=xrlp0cuRkyA&list=PLyzj0UDWZhCUx7kHzDsI3BTaUcohIZduA','https://colcagro.page.link/LvUq',394,1,2,'2021-11-22 11:36:51','2021-12-09 16:34:07'),(25,'prueba','descripcion','https://www.google.com.bo/','https://colcagro.page.link/phwj',393,2,2,'2022-02-08 08:47:33','2022-02-08 08:48:32'),(26,'MUJERES EN LA INDEPENDENCIA','El rol de la mujer que se tenía desde la Colonia con base en la  formación religiosa, de visión monárquica,  bajo una condición casi de sometimiento frente a una figura protectora del padre, del esposo, del hermano, cambió  en la Independencia. La mujer logra poco a poco desprenderse  de los elementos morales y culturales, se  acercó al conflicto político que se vivía en el virreinato, participó en él, e incluso tomó decisiones frente al mismo, sin que existiera el conocimiento de una garantía que la favoreciera,  lo importante era beneficio social, económico, estabilidad, tranquilidad para su familia, para su entorno, para su patria.\\nAlgunos historiadores mencionan a través de documentos, reflexiones, resignificaciones, el papel de mujeres combatientes en las batallas, generalmente al lado de sus maridos, se trataba de mujeres del pueblo a quienes se les conoció como las “Juanas”, las “cholas”, o las “seguidoras de campamento”.  Cuenta el General Daniel Florencio O’Leary, en sus Memorias, acerca de una de ellas que, siguiendo a las tropas por los Andes, dio a luz en el camino y continuó la marcha al día siguiente, con el recién nacido en sus brazos, por algunos de los peores caminos de la zona.\\nY es que para la Mujer, la Independencia fue la ocasión de incorporarse y participar con especial protagonismo de un hecho decisivo, asumieron una posición de vanguardia, entregaron lo más sagrado, lo igual o más que su propia vida, casi que con devoción, entregaron  a sus hijos para que se sumaran al Ejército Libertador.\\nDurante la Independencia, para sorpresa de los propios patriotas, las mujeres desplegaron un potencial de compromiso con los hechos públicos, hasta entonces desconocido, con fuerza, con valentía, con agilidad, con inteligencia. Su resistencia, heroicidad, protagónico desempeño en las luchas por la dignidad, igualdad y libertad.\\nDe ellas, es cierto, no nos quedaron discursos, canciones, escritos, plumillas, descripciones que nos revelaran su pensamiento político. Sólo nos queda, la memoria de su heroísmo,  su sacrificio, su fuerza, su acción, la entrega de sus riquezas, sus caballos, su ganado, alimentos,  asistieron a los heridos de las batallas, ofrecieron información sobre los movimientos de las tropas enemigas, ocultaron en sus casas a patriotas perseguidos, confeccionaron uniformes o ropas, brindaron comida a los guerreros.\\nBajo el régimen del terror innumerables mujeres fueron acusadas y castigadas por su apoyo a la causa libertaria. Fueron perseguidas por ser madres, esposas o hijas de patriotas reconocidos. La confiscación de los bienes, el destierro y la humillación fueron castigos sufridos por estas mujeres con mucha frecuencia, que terminaron con la muerte, fueron fusiladas.\\nEste caudal incontenible de acontecimientos que se iniciaron en 1781 con la Revolución de los Comuneros, que tomó fuerza el 20 de julio de 1810 y que dieron origen a nuestra República, quedó un relato histórico que exaltó a los próceres y héroes. En dicho panteón, las mujeres tuvieron poco lugar, no obstante la investigación ha ido descubriendo su participaron masiva y activa. \\nEl aporte de las mujeres a la Independencia fue notable y diverso. A pesar de que estaba prohibido incorporarlas a la filas de los ejércitos, las hubo…. Porfiadamente ocultas en un uniforme. Pero el principal aporte de las mujeres a la causa de la libertad lo hicieron como espías, mensajeras y enfermeras. \\nLa ironía de la historia está, en que pasada la guerra, el republicanismo recluyó de nuevo a las mujeres en la casa, en lo doméstico.  Los ideales de libertad y de derechos, que en algún momento las entusiasmaron, en el siglo XIX se olvidaron, tal vez por otras guerras. \\nEl 6 de agosto de 1819 en la ciudad de Tunja, el libertador simón Bolívar, en la proclama sobre la mujer expresaba que:   las mujeres han vestido al desnudo, saciado al hambriento, aliviado al adolorido y fortalecido al desfallecido…las mujeres han devuelto a un montón de hombres descorazonados y vacilantes, su antiguo brío, su impetuoso valor, y sus energías y todavía más les han devuelto su fe.\\n\\n\\n\\nPor Nubia Castillo Barón, Academia Casanareña de Historia.',NULL,'https://colcagro.page.link/vKLm',395,1,2,'2022-02-21 15:51:15','2022-02-21 15:51:17'),(27,'MUJERES CASANAREÑAS EN LA INDEPENDENCIA','Ana De Jesús Molina, Josefa Molina, Ana Francisca De Villafraes y Lama, Ana Julia Telelúa, Ana Julia Tetelúa,  Carmen Cucuban, Dominga Requiniva, Hnas. Teodora,  Ana De Jesús y Josefa Molina, Inés Munevar (fue quien acompañó al general Simón Bolívar aquella noche del 12 de junio, desde Tame), Rufina Cotorruma (sirvió por mucho tiempo como ama de llaves de Santander), Juana Béjar, Presentación Buenahora, Justa Estepa, María Antonia Martínez, María Del Carmen Varela y Santander, Petronila Reboyedo,  Juana Munèvar, Presentación Chincá, Rita Alquizá, Teodora Molina,\\nJUANA BÈJAR\\nFue Sargento Primero de Caballería del Ejército de las Huestes de la Libertad. Su familia igualmente militar. El documento que se encuentra es el poder que le confirió a su hermano también militar, Teniente Coronel Santiago Béjar, para cobrar sus haberes como militar, diligencia que se realizó en Pore,  el 23 de febrero de 1824, ante Joaquín Guevara, Alcalde Ordinario de Segunda Elección de ella, quien certificó conocerla y escucharla. Y dijo:\\nQuien por el presente publico instrumento da y confiere y sea necesario para valer en juicio y fuera de el al señor Teniente Coronel Santiago Béjar para que en su virtud pueda parecer representando su propia persona, derechos y acciones presentándose ante todos y cualesquiera Tribunales así Eclesiásticos como Seculares, así Superiores como Inferiores, tanto de Ultramar como de los Departamentos independientes de América, y en especial a los de la Republica, con el principal objeto de cobrar, recibir y vender el haber militar que le corresponde con respecta a la graduación militar de Sargento Primero de Caballería de la citada república que le está asignado y declarado por lo de la materia y además sueldos caídos que le pertenezcan como a uno de los antiguos servidores de la Patria. \\n“Que por el presente público instrumento da y confiere y sea necesario para valer en juicio y fuera de el al señor teniente coronel Santiago Béjar  para que en su virtud pueda parecer representando su propia persona, derechos y acciones presentándose ante todos y cualesquiera tribunales así eclesiásticos como seculares, así superiores como inferiores, tanto de ultramar como de los departamentos independientes de américa, y en especial a los de la república, con el principal objeto de cobrar, recibir y vender el haber militar que le corresponde con respecta a la graduación militar de sargento primero de caballería de la citada república que le está asignado y declarado por lo de la materia y además sueldos caídos que le pertenezcan como a uno de los antiguos servidores de la patria, como consta de los documentos que le tienen entregados al citado su apoderado.” \\nPRESENTACIÒN BUENAHORA\\nNació en Trinidad, Casanare el 13 de julio de 1786 a orillas del caño el Barajuste (Hoy Pore), era dueña de un extenso hato ganadero llamado Santa María ubicado en el sitio el Lagunazo, a la orilla del caño el Yatea y surtía de caballos y víveres a la guerrilla de Ramón Nonato Pérez. Ella misma ingresó a la escuadra de Ramón Nonato usando trabuco, espada y lanza. Su casa en Pore, era el punto de contacto entre los distintos grupos revolucionarios de Casanare. Hombres del Ejército Libertador varias veces hallaron allí refugio y auxilio. Siempre recibieron apoyo de esa mujer admirable, que sabía lo que se jugaba. \\nCon las mujeres de su hacienda y sus parientes, conformó una red de espionaje utilizando el acceso que tenían a las reuniones sociales en Pore capital de la provincia y centro administrativo y militar de los realistas. Los coroneles Santander y Pérez varias veces hallaron allí refugio y auxilio. Cayó en manos del coronel Bayer el 28 junio de 1816, después de combatir y perder su seno derecho por un espadazo. Llevada a juicio, reiteró que era patriota y que los invasores serían pronto arrojados de la Nueva Granada. Murió con valor, y con un gesto de orgullo en el semblante. La fusilaron el mismo día en la plaza de Pore para que sirviera de escarmiento a los rebeldes. Su sacrificio no quedó impune. En abril del año siguiente las guerrillas del fraile Mariño capturaron a Bayer y lo ejecutaron inmediatamente .\\nJUSTA ESTEPA\\nFusilada el 16 de Enero de 1817, bella, altiva, valerosa de sangre real indígena y altiva.  Luchó contra los españoles con valor y heroísmo. Fue la líder de varias indígenas anónimas que se sacrificaban al arrojarse sobre agudas estacas para eludir la servidumbre de los conquistadores y otras, que se lanzaban desde altas rocas para morir antes de ser esclavas. Esa era la enseñanza de heroísmo que orientaba. \\nY muchas de estas mujeres dejaron su herencia, ahí siguen, en varios rincones del llano encontramos mujeres que manejan sus caballos, el ganado, que se levantan con el lucero de la mañana, atraviesan grandes ríos y esteros, sacrifican y asan ganado sin problema, ayudan a construir sus casas. \\nA muchas se les registra por haber recibido la pena capital, entre ellas se encuentran:\\n\\n\\n\\nDOMINGA BURBANO: fusilada el 13 de diciembre de 1812.  DOMITILA SARASTI: fusilada el 11 de diciembre de 1812.  MERCEDES ABREGO DE REYES: fusilada el 13 de octubre de 1813  ROSA ZÁRATE DE PEÑA: fusilada y decapitada el 17 de julio de 1813.  RAMONA ALVARÁN: fusilada el 13 de febrero de 1813.  ROSAURA VELEZ DE PEÑA: fusilada en enero de 1814 EULALIA BUROZ DE CAMBERLAINE: despedazada a sablazos el 7 de abril de 1814. MARÍA DEL CARMEN Y BALBINA ULLOA: Fusiladas el 13 de abril de 1814.  ROSAURA RIVERA: fusilada el 26 de noviembre de 1816  PRESENTACIÓN BUENAHORA: fusilada el 28 de Junio de 1816.  CARLOTA ARMERO: fusilada el 28 de mayo de 1816 AGUSTINA MEJÍA: fusilada el 8 de septiembre de 1816.  JOAQUINA AROCA: fusilada el 5 de septiembre de 1816.  JUANA RAMÍREZ: fusilada en marzo de 1816.  ANSELMA LEYTON: fusilada el 17 de enero de 1817.  MARTHA TELLO: fusilada el 12 de noviembre de 1817.  MERCEDES LOAIZA: fusilada el 16 de septiembre de 1817.  REMIGIA CUESTAS: fusilada en 2 de diciembre de 1817.  SALOMÉ BUITRAGO: fusilada el 3 de diciembre de 1817.  ANTONIA MORENO: fusilada el 19 de septiembre de 1817.  BIBIANA TALERO: fusilada el 21 de noviembre de 1817.  CANDELARIA FORERO: fusilada el 26 de noviembre de 1817.  DOLORES SALAS: fusilada el 14 de Septiembre de 1817.  GREGORIA POLICARPA SALVARRIETA RÍOS: Fusilada el 14 de nov de 1817.  IGNACIA MEDINA: fusilada el 9 de diciembre de 1817.  INÉS OSUNA: confinada y sacrificada el 6 de septiembre de 1817.  MARÍA DEL ROSARIO DEVIA: fusilada el 16 de septiembre de 1817.  JUSTA ESTEPA: fusilada el 16 de enero de 1817.  LUISA TRILLERAS: fusilada el 18 de septiembre de 1817 EVANGELINA DÍAZ: fusilada el 19 de agosto de 1818.  MANUELA USCÁTEGUI: fusilada el 20 de diciembre de 1818.  TERESA IZQUIERDO: fusilada el 24 de julio de 1819.  MANUELA Y JUANA ESCOBAR: lanceadas el 10 de julio de 1819.  MARIA ANTONIA SANTOS PLATA: fusilada el 28 de julio de 1819.  AGUSTINA FERRO: fusilada el 20 de mayo de 1820\\n\\n\\n\\nPor Nubia Castillo Barón, Academia Casanareña de Historia.',NULL,'https://colcagro.page.link/LP4V',395,1,2,'2022-02-21 16:09:12','2022-02-21 16:09:14'),(28,'CARMENZA MURGUEITIO, PRIMERA MUJER ALCALDESA DE YOPAL','(tomado de la investigación de Miguel Arango)\\nTranscurrían los días finales de octubre de 1.966. En el paraje que hace esquina entre la alcaldía con la casa de doña Adelina, regularmente se reúnen, ganaderos, chocoteros, cagones, caporales y comerciantes, a esperar los ganados que llegan de Tilo, a hablar de política y tal cual chisme que le inventan a los pocos habitantes del poblado que apenas tiene unas 60 casas, la mayoría alrededor de un gran potrero donde pastan unas vacas viejas unos burros y que llaman parque principal. \\nEl tema del día es la inauguración de la primera factoría que será instalada en Yopal, capital de la prefectura de Casanare. Una fábrica de Gaseosas que estará compitiendo con reconocidas bebidas dulces como Leona Pura, Kolcana, Pepsicola, Cocacola, Bretaña y gaseosas Lux, que traen en camiones de Duitama. \\nLa fábrica ubicada a unos 100 metros al norte del Chiribitillo, en inmediaciones de la casa de Billete Grande, ya tiene en el portón de dos alas, un aviso tallado en madera y adornado por una caramera de lo que en vida fue un toro criollo con enormes cuernos y que a lo ancho se lee, GASEOSAS DEL LLANO. \\nLos dueños de la industria, ya son conocidos por la feligresía local, se trata de Carlos Eduardo Riaño Medina, un Boyacense vinculado con la fabricación de tejas y ladrillos de barro y su esposa Carmenza Murgueitio, una hermosa caleña quien desde que llegó a Yopal, se hizo amiga de todos los habitantes del pueblo. \\nSu simpatía le ha permitido liderar una serie de reuniones con las más destacadas familias locales, con el objetivo de reunir los recursos económicos para construir, El Club Casanare, que sería un centro de convenciones donde se podrían hacer reuniones, atender al Presidente de la República y sus ministros o al Gobernador de Boyacá y sus secretarios cuando lleguen a Casanare, pero especialmente, un lugar de esparcimiento familiar, similar al Club San Fernando de Cali.\\nPara mediados de 1967, el Club Casanare fue engalanado para atender al gobernador de Boyacá, Antonio Bayona Ortiz, el segundo mandatario que visitaba las agrestes tierras de Casanare.  El primero había sido Gustavo Romero, quien el 20 de marzo de 1963 había llegado a Yopal a inaugurar el puente La Cabuya, sobre el río Cravo, ceremonia que terminó en tragedia porque el puente se desplomó, dejando numerosas víctimas, entre ellas al médico Braulio González, al senador Luis Hernández Vargas y al alcalde Robinson Prada.\\nLa noche de inauguración del Club Casanare, fue seguramente la más grande ceremonia social de la Prefectura, pues, contó  con la presencia de las fuerzas militares, el coronel Eduardo Román Basurto comandante del DAS Rural, los Jerarcas de la Iglesia Católica, los Ganaderos y comerciantes, algunos políticos y en la mesa principal, el Gobernador Bayona Ortiz y sus secretarios.\\nComo epilogo de la pomposa reunión, el mandatario de los boyacenses, y casanareños desde luego, le preguntó a la concurrencia a quien postulaban para el cargo de alcalde de Yopal y por unanimidad fue aclamado el nombre de Carmenza Murgueitio de Riaño. \\nLuego de las consultas legales ante el Ministerio de Gobierno y la Presidencia de la República, para establecer si se podía nombrar o no una mujer como alcalde, hasta esa fecha mujer alguna había ocupado ese cargo en el País, recordemos que solo hasta el primero de diciembre de 1957, la mujer pudo votar.\\nLa respuesta del poder central fue, “En concordancia con la reforma constitucional realizada el 27 de agosto de 1954, la mujer goza de las mismas prerrogativas políticas de los hombres, por lo tanto, puede ocupar cargos públicos”.\\nBajo el amparo de esta reforma Constitucional, el gobernador Antonio Bayona Ortiz profirió el decreto por medio del cual se designó a Carmenza Murgueitio de Riaño, como alcaldesa de Yopal, capital de la Prefectura de Casanare. \\nLas cosas marchaban bien hasta que, las damas de la sociedad, se enteraron que la alcaldesa había ordenado que las 12 muchachas que se dedicaban a vender placer, estaban siendo favorecidas por doña Carmenza, quien les había ordenado someterse a control médico a fin de evitar una endemia de enfermedades de transmisión sexual entre los señores del pueblo. \\nLa medida dividió la opinión pública y a mediados de 1.968  el gobernador Ernesto Roa Gómez, le acepto la renuncia.\\nBibliografía\\n  Forero, Pablo E. Las Heroínas Olvidadas de la Independencia. Bogotá: 1972, Canal Ramírez – Antares – Imprenta, Litografía y Rotigrabado. Págs. 156 – 158. \\n\\n\\n\\nPor Nubia Castillo Barón, Academia Casanareña de Historia.',NULL,'https://colcagro.page.link/ifd9',381,1,2,'2022-02-21 16:21:57','2022-02-21 16:21:59');
