INSERT INTO `farms` VALUES (1,'Finca Ganadera de 1.600 Hectáreas, con cerca se 900 pradizadas, con pasto Huminicola, ganaderia Brangus de 15 años de genética, además, cuenta con 5 Esteros o lagos de entre17 y 47 hectáreas. Mas de 40 potreros y 40 kilómetros en cercas eléctricas,  cuentas con tres casas, dos corrales de mas de 5 mil metros 2° unas instalaciones y belleza sin igual. A dos horas de Yopal, Vía Yopal, Tilodiran-Los Mangos, Vereda Surimena.','Orocué',1600,15000,7,16000000000,-71.9556388,4.8753650,'venta','https://colcagro.page.link/BK2F','2021-08-09 06:09:55',386,4,1,'2021-07-20 06:52:40','2021-08-11 09:26:32'),(2,'Finca Guafilla','65',20,45,2,50000000,-72.4812103,5.2630885,'renta','https://colcagro.page.link/FtTi','2021-08-09 14:49:21',378,12,2,'2021-07-21 08:25:57','2021-07-21 08:27:17'),(3,'Descripcion','Cl. 77 #8588',95544,5558,6688,587676467,-74.1023110,4.7013197,'venta','https://colcagro.page.link/v5Do','2021-08-12 10:41:25',523,2,3,'2021-07-23 17:06:10','2021-07-26 16:25:06'),(4,'Finca de prueba','Cl. 32 #1655',2,30,2,10000000,-72.3941599,5.3270236,'venta','https://colcagro.page.link/br1n','2021-08-30 12:54:41',378,12,4,'2021-08-11 11:01:00','2021-09-01 10:56:44'),(5,'Super finca','Cra. 22 ##22A-26',25,25888,2,25000000,-74.0809396,4.6167987,'renta','https://colcagro.page.link/26tN',NULL,523,2,5,'2021-08-12 13:53:10','2021-08-12 14:21:35'),(6,'La finca cuenta con 6 hectareas con escritura e impuestos al día,  cuenta con. Vivienda de dos habitaciones, baño, cocina, kiosco, servicio de luz y acueducto, está condicionada para ganadería y agricultura y con 600 matas de plátano, y pozo de pescado. Se encuentra a a 19 km del casco urbano de Yopal. Vereda Tacarimena.','Via Tacarimena',6,100,1,420000000,-72.2192631,5.3653394,'venta','https://colcagro.page.link/jKtN',NULL,378,1,1,'2021-08-25 09:59:36','2021-08-25 11:56:03'),(7,'Gran finca productiva Ganaderia.  Terreno 50% sembrada en caña 50% en pasto artificial . La propiedad cuenta con 4 casas, Trapiche semindustrial','Vía San José de Suaita',133,700,8,5320000000,-73.4566543,6.1389366,'venta','https://colcagro.page.link/ihqu','2021-09-12 16:19:18',979,1,4,'2021-09-01 14:55:16','2021-09-01 15:39:42'),(8,'Finca ubicada en la Vereda Pereira, corregimiento La Hermosa. Dedicación ganadera. 100hectareas de pasto, vía de acceso en 4*4, cuenta con paneles solares. \nSe vende con Avión Cessna 180 (pista autorizada) y 1.000 cabezas de ganado.','Paz de Ariporo',5800,100,1,7500000000,-71.4935060,5.8446078,'venta','https://colcagro.page.link/xiMV','2021-09-12 16:19:18',387,1,4,'2021-09-01 17:04:27','2021-09-01 17:04:48'),(9,'Hacienda  ubicada en Trinidad - Casanare\nÁrea total en pasto artificial\nCanales de drenaje.\nExcelentes vías de acceso \n\nÁrea 700 HA\nÁrea construida \n1000 mts -Corrales ganaderos techados con gas domiciliario y acueducto. \n4 habitaciones 2 baños kiosko de descanso.','Trinidad Airport',700,100,4,8400000000,-71.6655593,5.4250426,'venta','https://colcagro.page.link/4zHd','2021-10-12 16:19:18',395,1,4,'2021-09-02 15:25:36','2021-09-02 15:29:11'),(10,'Finca apta para la ganadería, pradizada con pastos en un 70% artificiales y 40% naturales, \r\ncercada en alambre de pua y divisiones en cercas electicas, cuatro (4) canales de agua \r\nveranera dotado de saleros para consumo masivo de suplementación del ganado, buena \r\narborización de nativo y artificiales como teca, adecuadas instalaciones para el encargado, \r\ntrabajadores, bodegas, hangar para tractor y más apartamento para los propietarios (dueño).\r\nUbicada a 18 kilómetros de yopal, vía nocuito, con buen acceso carreteable, a 800 metros \r\nsobre la vía, igual con buen acceso al interior de la vivienda, también cuenta con instalaciones \r\nde corrales, brete, bascula, sala de ordeño e instalaciones para lombricultivo y con una \r\nsuficiente área de pan coger, pozo profundo, pozo séptico, aljibe, motobomba y electrobomba\r\nHistóricamente se ha mantenido un promedio de 250 ganados vacunos, de cría, levante y seba \r\nadicionalmente un atajo de 15 caballos.','7PXC+2F Yopal',95,300,2,5700000000,-72.2787998,5.2975768,'venta','https://colcagro.page.link/25w1',NULL,378,1,4,'2021-11-24 09:58:49','2021-11-24 10:02:52');
