INSERT INTO `subscription_types` VALUES (1,'Animales','#ef6087',1000,'Publica tus animales (bovinos, equinos, caprinos, porcinos, ovinos) para la venta, ceba o subasta, de forma ágil y efectiva.'),(2,'Transportadores','#add172',12500,'Publica tus vehículos para el transporte de animales, en cualquier parte del país. Encuentra clientes de forma ágil y segura.'),(3,'Profesionales','#4ad1c7',0,'Da a conocer tu perfil como técnico, tecnólogo o profesional en áreas afines al sector agropecuario. Extiende tus posibilidades para una vinculación laboral.'),(4,'Trabajos afines','#4ad1c7',0,'Da a conocer tu perfil ocupacional como trabajador del sector agropecuario, extiende tus oportunidades laborales.'),(5,'Insumos fincas','#8b9dff',12500,'Publica tus insumos, productos, y maquinaria agrícola para alcanzar a muchas más personas. Conectate con tus clientes de forma fácil, ágil y segura.'),(6,'Insumos animales','#8b9dff',6250,'Publica tus medicamentos, productos, o insumos para la ganadería. Conectate con tus clientes de forma  fácil, ágil y segura.'),(7,'Fincas','#ffaf52',0,'Publica tus propiedades y terrenos rurales para la venta o arriendo. Vende o renta con seguridad y eficiencia.'),(8,'Gratuita','#4ad1c7',0,'Prueba totalmente gratis, durante un mes, nuestra plataforma, para que conozcas y navegues por cada uno de los servicios de forma libre y segura.  Revise términos y condiciones');
