to','Ninguna',1,9,'https://colcagro.page.link/CwCn','2021-08-30 12:54:41','-72.4021442','5.3479651',378,2,'2021-08-10 15:56:34','2021-08-18 12:08:26'),(11,292,'Prueba','Prueba','Ninguna',50000,9,'https://colcagro.page.link/nRXv','2021-08-30 12:54:41','-72.4021442','5.3479651',654,2,'2021-08-11 09:29:46','2021-08-11 09:31:41'),(12,18,'Insumo.prueba','Prueba 18','Acme',20000,2,'https://colcagro.page.link/jVP3','2021-09-09 13:41:28','-72.4016372','5.3484739',378,2,'2021-08-18 17:37:09','2021-08-18 17:51:45'),(13,292,'Insumo prueba','Prueba 18','Acme',20000,9,'https://colcagro.page.link/TWi7','2021-09-12 16:19:18','-72.4021442','5.3479651',378,2,'2021-08-18 17:40:34','2021-08-19 08:49:21'),(14,324,'Publica tus insumos','Describe a detalle cada uno de tus productos','Ninguna',10,9,'https://colcagro.page.link/WxqJ','2021-10-12 16:19:18','-72.4021442','5.3479651',378,1,'2021-08-21 09:44:10','2021-09-25 09:25:17'),(15,33,'Fumigadora de Espalda Manual JACTO XP-20','Equipo liviano de excelente calidad y eficiencia.  Es una fumigadora de espalda práctica que cuenta con 3 años de garantía.','JACTO',186239,11,'https://colcagro.page.link/kab3','2021-11-24 11:08:59','-75.6053927','6.1643901',72,1,'2021-08-24 13:54:09','2021-10-11 11:36:27'),(16,125,'Semilla de PASTO Tanzania (Incrustada).','Es muy exigente en fertilidad requiere un buen drenaje del suelo y precipitaciones por encima de 1000 mm por año.\n\nMuy resistente a la sequía, el frío y los pastos de sombreado de salta hojas. Sin embargo, no tolera un encharcamiento excesivo.\n\nEs indicado para pastoreo directo, principalmente en sistemas intensivos con pastoreo rotacional. Produce heno de buena calidad y puede ser usado para hacer ensilado, siempre que se corrijan los niveles de carbohidratos solubles. En áreas con pendiente elevada y sujeta a la erosión es aconsejable optar por las gramíneas de crecimiento más horizontal y proporcionar mayor cobertura de suelo.\n\nLos mejores resultados se obtienen con el uso de rodillo compactador, que permite la incorporación de esas semillas a 2,0 cm de profundidad, además de aumentar el contacto de las mismas con el suelo, acelerando el proceso de entumecimiento. En el caso de uso de rejilla niveladora, ésta debe ser cerrada y el tractor debe trabajar con bastante velocidad (3a simple), para evitar que las semillas queden por debajo de 4,0 cm.\n\nLa producción que van desde 20 a 30 toneladas de materia seca / ha / año. Su palatabilidad es excelente, siendo su composición aproximada de 10 a 16% de proteína bruta en la materia seca y digestibilidad in vitro en torno al 60%. En promedio esta gramínea lleva de 90 a 120 días después de la germinación para su formación. El primer pastoreo debe ser hecho cerca de los 90 días con ganado leve. En esta fase, el pastoreo presenta altura en torno a 1,0 m, siendo los animales retirados cuando la altura llega a 30 cm. El primer pastoreo con ganado ligero optimiza el establecimiento de la invernada. Es común presentarse ligeramente amarillento en la sequía en función de su alta demanda por nitrógeno durante todo el año.','Carioca',33000,13,'https://colcagro.page.link/MSbd','2021-08-31 16:55:34','-75.5827649','6.2337651',12,2,'2021-08-24 15:08:26','2021-08-24 15:14:41'),(17,125,'Semilla de PASTO Mombasa Incrustada','Gramínea de ciclo vegetativo perenne y crecimiento entubado.\n\nAdaptación \n\nEs un poco menos exigente en la fertilidad que la Tanzania-1, ya que tiene una mayor eficiencia en el uso de fósforo lábil en la solución del suelo. Requiere suelos bien drenados y precipitaciones por encima de 1300 mm anuales.\n\nResistencia\n\nTiene buena resistencia a la sequía, el frío y el promedio de tolerancia a la sombra y pastos saltahojas (Zulia entreriana). No tolera, sin embargo, encharcamiento en exceso.\n\nIndicación \n\nSe indica para pastoreo directo, particularmente en sistemas intensivos con pastoreo rotacional y la fertilización química. Se requiere, sin embargo, el período de recuperación más corto y tiene mayor cantidad de las hojas de la mayoría de P Anicuns, siendo su senescencia natural menor que la de los demás en el período seco. Muy utilizado en piquetes de tropa (équidos), produce heno de buena calidad y puede ser usado para hacer ensilado, siempre que se corrijan los niveles de carbohidratos solubles.\n\nProfundidad de plantación\n\nLos mejores resultados se obtienen mediante el uso de compactador de rodillos que incorpora las semillas a 2,0 cm de profundidad, aumentando el contacto del mismo con el suelo. En el caso del uso de la rejilla niveladora, ésta debe ser cerrada y el tractor debe trabajar con velocidad más alta (3a simple), para evitar que queden por debajo de 4,0 cm\n\nProducción \n\nProducción variando de 20 a 30 toneladas de materia seca / ha / año. Presenta 9 a 14% de proteína bruta en la materia seca, digestibilidad in vitro en torno al 60% y alta palatabilidad.\n\nGestión\n\nEl tiempo de entrenamiento es de alrededor de 90 a 120 días. El primer pastoreo debe ser hecho con ganado leve cuando el pasto presenta altura alrededor de 1,20 m (en promedio, a los de 90 días). Los animales deben ser retirados cuando las plantas tengan 30 cm. Se debe prestar atención a esta altura de salida de ganado, ya que su elevado tamaño puede convertirse en un problema en manejo de ella.','Carioca',48900,13,'https://colcagro.page.link/jw41','2022-06-07 17:23:13','-75.5827649','6.2337651',12,1,'2021-08-24 15:17:23','2021-12-09 15:45:42'),(18,125,'Semilla de PASTO Humídicola incrustada','Gramínea de ciclo vegetativo perenne y forma de crecimiento entubado.\n\nRecomendado para la fertilidad del suelo medio requiere alta precipitación anual alrededor de 1200 mm, más productiva, sin embargo, a mayor precipitación anual (1.700 mm / año). Se diferencia de otros cultivares de Brachiaria brizantha, principalmente debido a su mayor capacidad y mejor hoja de rebrote / vástago de relación, lo cual se refleja en un mejor rendimiento.\n\nPresenta sistema radicular muy profundo y vigoroso, lo que hace que sea considerado como el Brachiaria brizantha de mayor tolerancia a la sequía. También posee buena resistencia al frío y al sombreado. Es susceptible a la cigarrilla de los pastos y tolera encharcados medios de suelo. Vale recordar, sin embargo, que esa gramínea no tolera inundación de suelo.\n\nSiembra\n\nIncorporar las semillas alrededor de 2.0 cm con disco cerrado después de la distribución completa en la misma zona. Así como para las demás especies, los mejores resultados se obtienen, pasando el rodillo compactador tras la incorporación de la semilla al suelo\n\nProducción de entre 20 y 30 toneladas de materia seca / ha / año. Su composición media es de 9 a 12% de proteína bruta en la materia seca, con un 60% de digestibilidad in vitro y alta palatabilidad.\n\nEl tiempo de formación gira alrededor de 90 a 120 días después de la germinación y el primer pastoreo debe ser hecho a los de 90 días con ganado leve. En ese momento presenta altura en torno a 1,0 metro debe retirar el ganado cuando las plantas estén alrededor de 30 cm. Se suele decir \"que el ganado no debe coger frío en las canelas, solamente de la rodilla hacia arriba\". El primer pastoreo con ganado la luz es un factor esencial para la formación adecuada de los pastos.','Carioca',69000,13,'https://colcagro.page.link/Vz1M','2022-06-07 17:23:13','-75.5827649','6.2337651',12,4,'2021-08-24 15:20:06','2021-12-09 15:45:22'),(19,125,'Semilla de PASTO Dictyoneura incrustada','Gramínea de ciclo vegetativo perenne y forma de crecimiento estolonífero.\n\nSe adapta bien a las condiciones de fertilidad del suelo bajo promedio y requiere una precipitación anual de alrededor de 1,500 mm.\n\nResiste muy bien a la sequía, el sombreado y el pisoteo. En cuanto a encharcamiento de suelo presenta buena tolerancia, no soporta inundaciones por mucho tiempo. Posee baja tolerancia a la cigarrilla de los pastos y se considera excelente hospedador de ese insecto.\n\nAmpliamente utilizado en potreros para caballos y productos lácteos por tener alta palatabilidad. En general, se utiliza sólo para pastoreo directo.\n\nSiempre que sea posible, seguir la misma recomendación hecha para Brachiaria humidicola con relación a la mezcla de especies, pues así se puede reducir el costo de implantación y acelerar la cobertura del suelo.\n\nsiembra\n\nIncorporar las semillas alrededor de 2.0 cm con disco cerrado después de la distribución completa en la misma zona. Los mejores resultados se obtienen, pasando el rodillo compactador después de la incorporación, pues se aumenta el contacto de las mismas con el suelo lo que acelera el proceso de entumecimiento y germinación de las semillas.\n\nProduce alrededor de 10 toneladas de materia seca / ha / año, con 8 a 10% de proteína bruta en la materia seca y digestibilidad in vitro variando de 55 a 65%.\n\nSe puede tomar alrededor de 200 días a una formación satisfactoria y el consiguiente uso de los pastos. Esto se debe a que las semillas de esta especie, también pueden presentar variados grados de entumecimiento. Por la característica de crecimiento estolonífero, se vuelve fundamental no rebajar ese pastoreo a menos de 10 cm, pues hasta ese punto la especie todavía puede expresar todo su potencial productivo y nutricional.','Carioca',58200,13,'https://colcagro.page.link/Y5aP','2022-06-07 17:23:13','-75.5827649','6.2337651',12,1,'2021-08-24 15:25:46','2021-12-09 15:45:27'),(20,125,'Semilla de PASTO Decumbens Incrustada','Gramínea de ciclo vegetativo perenne y forma de crecimiento decumbente.\n\nSe adapta bien a las condiciones de fertilidad del suelo bajo promedio y requiere una precipitación anual de alrededor de 1,000 mm. Nada impide que sea usado en suelos de fertilidad más elevada, pues es altamente responsable a la fertilización química. Sin embargo, existen otras especies más productivas, recomendadas para esas condiciones.\n\nAl tener un sistema de raíces muy profundas, es resistente al verano. Presenta media resistencia al frío, buena tolerancia a sombreado y baja tolerancia a suelos empapados o encharcados. Es altamente susceptible a la cigarra de los pastizales.\n\nEs indicada para pastoreo directo, hacer rodillos, y guandú. No se recomienda su uso para el ensilado.\n\nsiembra\n\nIncorporar las semillas como máximo a 3,0 cm de profundidad. Esta incorporación puede ser hecha después de la distribución de las semillas en toda área con el uso de rejilla niveladora cerrada o apenas usar un rodillo compactador. Se puede, además, optar por la combinación de las dos técnicas, lo que, en general, presenta resultados superiores.\n\nSu producción media se estima en alrededor de 10 toneladas de materia seca / ha / año y la composición de proteína cruda 7 a 9% en materia seca y 50 a 60% de digestibilidad in vitro. Tiene buena palatabilidad.\n\nEn el período normal de plantación, presenta tiempo de formación en torno a 90 días. El primer pastoreo se puede hacer en esta fase, entre 90 y 100 días después de la germinación. En ese momento, la planta presenta una altura de alrededor de 80 cm. El ganado debe ser retirado cuando esté a una altura de alrededor de 30 cm.','Carioca',30800,13,'https://colcagro.page.link/VSCr','2022-06-07 17:23:13','-75.5827649','6.2337651',12,1,'2021-08-24 15:28:05','2021-12-09 15:45:35'),(21,6,'Elixir Supreme','DESCRIPCIÓN DEL PRODUCTO\n\nNPK 12:11:18-2% Mg0 15 %5-0.01%-0.02%2nTE IF Mnl Es un fertilizante compleja, mineral.\n\ninorganico, solido, que contiene todos los macroelementos Nitrógeno(N), FostoralP), Potasiolk, enriquecidas con los elementos secundarius: Magnesin (Mg0) y Azufre (51 y microelementes como: Bara (Brl y Zine (2nl. Trazas de Hierro (Fely Manganeso IMnl. Ei fertilizante es pobre en Cloruro. Es una formula quimica estabilizada, que permite disponer de los nutrientes durante el mayor tiempo posible, dando oportunidad a que el cultivo pueda absorber mejor y por mas tiempo los elementos quimicos.\n\nAPLICACION\n\nCada granulo contiene todos los elementos quimices ofrecidos, con la cual se favorece de manera efectiva al proceso nutricional de varias especies de plantas en diferentes tipos de suelos pudiéndose aplicar mecánicamente con espartidores o con la mano,\n\nEMBALAJE\n\nEl fertilizante se empaca en sacos con peso neto de 25Kg, 1000Kgy 1200kg\n\nALMACENAMIENTO\n\nPuede almacenarse en depósitos cerrados, semicerrados o abiertos, a temperatura ambiente moderada en su empaque original. Los empaques abiertos deben volver a cerrarse hermeticamente despues de retirar el fertilizante y almacenarse en un lugar seco. Si se almacena adecuadamente en su embalaje original la fecha limite de uso se podrá extender.\n\nRegistro de Venta ICA 12130 a nombre de pardopardo sas','Elixir Zorca',85000,14,'https://colcagro.page.link/Lw3m','2022-06-26 12:05:16','-72.3882936','5.3258754',378,4,'2021-09-06 12:15:05','2022-01-17 16:10:07'),(22,54,'Bretes','Bretes metálicos en tubería galvanizada. El valor depende de las caracteristicas requeridas','Ingacas',1000,16,'https://colcagro.page.link/ygg6','2021-12-07 16:38:57','-72.3941914','5.3320703',378,1,'2021-09-08 09:28:49','2021-10-04 10:32:50'),(23,54,'Corrales prefabricados','Corrales prefabricados en tubo y guaya con implementacion de cierres rápidos  Según especificaciones del cliente.','Ingacas',1000,16,'https://colcagro.page.link/TMhD','2021-12-07 16:38:57','-72.3941914','5.3320703',378,1,'2021-09-08 09:33:13','2021-10-04 10:32:54'),(24,55,'Postes prefabricados','Según especificaciones del cliente.','Ingacas',1000,16,'https://colcagro.page.link/peMG','2021-12-07 16:38:57','-72.3941914','5.3320703',378,1,'2021-09-08 09:38:42','2021-10-04 10:32:58'),(25,364,'Fertilizante Urea Zeonitron','Fertilizante Urea Zeonitron\nExcelente producto a base de Zeolita y nitrógeno en mezcla física logrando una gran eficiencia ya que se evita la volatilización y lixiviación de la urea.\n\nCARACTERÍSTICAS\nCategoría: Fertilizantes y enmiendas\nSubcategoría: Fertilizantes Simples Edáficos','Zeocol',90000,17,'https://colcagro.page.link/HSa4','2021-09-30 16:58:42','-75.6856485','4.5184204',873,2,'2021-09-10 17:42:24','2021-09-10 17:58:50'),(26,124,'Fertilizante orgánico Zeolita agricola','Zeolita Zeocol Agrícola\nEs un mineral no metálico, de origen y formación volcánica totalmente natural. El inmenso poder de absorción y absorción de la zeolita permite el almacenamiento de nutrientes para una liberación posterior, gradual y dosificada, que permite el mayor aprovechamiento. Esto se denomina intercambio ionico y catatónico y sus beneficios pueden ser observados y demostrados en cualquier tipo de cultivo. Las propiedades de la Zeolita lo hacen un sustituto excelente en varios usos. No se altera, es químicamente inocuo, no contamina y es limpio.\n\nLas Zeolitas han sido probadas y reconocidas como los materiales naturales más eficientes para el mejoramiento de suelos, control de olores, tratamiento de aguas, entre otros usos, siendo además un mineral completamente amigable con la naturaleza.\n\nOrigen de las Zeolitas.\nLas Zeolitas son aluminosilicatos hidratados originados por fenómenos geológicos de transformación como resultado de una reacción con aguas alcalinas de cenizas volcánicas depositadas en lagos y mares someros.\n\nCARACTERÍSTICAS\nCategoría: Fertilizantes y enmiendas\nSubcategoría: Fertilizantes Solubles','Zeolitas de Colombia',63500,18,'https://colcagro.page.link/3Byo','2022-03-07 17:20:31','-75.6726657','4.5365856',873,1,'2021-09-10 17:57:41','2021-12-07 17:31:28'),(27,6,'Fertilizantes Urea Zeonitron','Fertilizante Urea Zeonitron\nExcelente producto a base de Zeolita y nitrógeno en mezcla física logrando una gran eficiencia ya que se evita la volatilización y lixiviación de la urea.\n\nCARACTERÍSTICAS\nCategoría: Fertilizantes y enmiendas\nSubcategoría: Fertilizantes Simples Edáficos','Zeolitas de Colombia',90000,18,'https://colcagro.page.link/d177','2022-03-07 17:20:31','-75.6726657','4.5365856',873,1,'2021-09-10 18:00:57','2021-12-07 17:31:32'),(28,365,'Zeocol alimentacion animal','Zeolita Nutrición Animal permite retener nutrientes presentes en el alimento de los animales y de manera dosificada en el tracto intestinal. Tiene además, un efecto astringente que demora el paso del bolo alimenticio para lograr la mayor capacidad de acción enzimática de los diferentes ácidos en el proceso digestivo.\n\nBeneficios\n• Mejora el aprovechamiento de nutrientes.\n• Produce abonos orgánicos de excelente calidad.\n• Controla los olores en instalaciones pecuarias\n• Disminuye la presentación de diarrea\n• Previene la contaminación y el desarrollo de hongos en granos y concentrados.\n\nUsos\nSe utiliza en reemplazo promedio de un 3% de las fuentes de nutrientes mayores en cualquier alimento balanceado., y hasta un 5% en sales en cualquier especia y fase de producción, en mezclas física y química. *Debe hacerse bajo recomendación de un medico v/o zootecnista o profesionales afines.\n\nCARACTERÍSTICAS\nCategoría: Nutrición animal\nSubcategoría: Materias primas\ncalidad: 1\nPotasio: 0.15-3.17\nCalcio: 1,5 - 2.75\nMagnesio: 0,5-0.83\nHierro: 1-2,0\nSodio: 1.02-1.16\nSilicio: 63.13-78.2','Zeolitas de Colombia',63500,17,'https://colcagro.page.link/amGf','2021-12-06 15:21:22','-75.6856485','4.5184204',873,4,'2021-09-10 18:10:35','2021-11-08 11:38:56'),(29,12,'Zeolita para tratamiento de aguas','Zeolita Zeocol Tratamiento de Aguas\nLas zeolitas se usan en la remoción de gases perjudiciales en filtros de acuarios y estanques. Como sustancia de filtración, puede reducir la deposición de calcio en el agua, con lo cual se reducen los residuos en sistemas de irrigación.\n\nLa zeolita natural es el mejor sistema de filtración natural que existe para tratamiento de agua. Ofrece un efecto superior al de la arena o al de los filtros de carbón, resultando en agua más pura con mejor productividad y requiriendo menos mantenimiento. La estructura altamente porosa de las zeolitas puede capturar partículas contaminantes de hasta 4 micras. Las zeolitas están cargadas negativamente de forma natural, por lo que pueden adsorber cationes, como metales pesados y amoníaco. También pueden absorber algunos contaminantes orgánicos y olores no deseados.\n\nBeneficios\n. Baja caída de presión\n. Alta capacidad de intercambio de catiónico\n. Alta carga de solidos\n. Resistente\n. Puede tener capacidades de ablandamiento de agua\n\nPuede tratar\n. Turbiedad\n. Metales pesados\n. Hidrocarburos\n. Bacterias\n. Amoniaco\n. Nitratos y Fosfatos\n. Aceites\n. Olor\n\nAplicaciones\n. Tratamiento de aguas potable\n. Tratamiento de aguas residuales terciarias / control de la contaminación\n. Tratamiento de aguas radiactivas.\n. Acuicultura de agua dulce / industria pesquera\n. Proceso industrial de pre-tratamiento de agua\n. Tratamiento de aguas grises','Zeolitas de colombia',63500,18,'https://colcagro.page.link/RM4n','2022-03-07 17:20:31','-75.6726657','4.5365856',873,1,'2021-09-10 18:13:36','2021-12-07 17:31:38'),(30,126,'Semilla Cuba 22','PASTO DE CORTE CUBA22','Cuba 22',2000,20,'https://colcagro.page.link/3Skm','2021-10-05 15:20:17','-72.4506938','5.4517489',378,1,'2021-09-15 16:36:29','2021-09-15 16:43:30'),(31,126,'Semilla de Caña Forrajera','Caña Forrajera  (picado en fresco, silo, miel de caña)','Caña Forrajera',2000,20,'https://colcagro.page.link/dAfV','2021-10-05 15:20:17','-72.4506938','5.4517489',378,1,'2021-09-15 16:38:56','2021-09-15 16:38:56'),(32,122,'Tierra de Diatomeas','Alga marina fosilisada 25 Kilos','Ninguna',110000,22,'https://colcagro.page.link/XnoN','2021-10-16 15:06:02','-72.3899800','5.3311518',378,1,'2021-09-26 15:25:30','2021-09-26 15:39:45'),(33,122,'Tierra de Diatomeas','Algas marinas fosilisadas','Ninguno',12000,22,'https://colcagro.page.link/jkZr','2021-10-16 15:06:02','-72.3899800','5.3311518',378,1,'2021-09-26 15:31:32','2021-09-26 15:31:33'),(34,124,'Polisulfato Diatomico 4 Litros','Fertilizante líquido orgánico para todo tipo de cultivo. Dosis sugerida: 1Litro de producto x 200 Litros de agua','Organico',50000,22,'https://colcagro.page.link/dMwT','2021-10-16 15:06:02','-72.3899800','5.3311518',378,1,'2021-09-26 15:38:57','2021-09-26 15:38:58'),(35,262,'EDO-CUR Fenbendazol 10% 500ml','Antiparasitario de tipo oral. INDICACIONES\n\nEN BOVINOS, EQUINOS, OVINOS Y CAPRINOS:\n\nPara el tratamieto de Haemonchus sp, Ostertagia Trichostrongylus\nNematodirus sp, sp, Cooperia Oesophagostomum Chabertia sp, toxocara Bunostomum vitulorum, sp, Trichuris Capillaria sp, sp., Strongylus sp, Dictyocaulus sp, Moniezia sp.\nEn Equinos: Strongylusvulgaris, Oxyurisequi, Strongylus ParascarisTrichostrous axeiedentatus,\nequorum,\n\nDOSIFICAL\n\nBOVINOS, OVINOS Y CAPRINOS:\n5 mL por cada 100 Kg de peso.\nEQUINOS: 7,5 mL por cada 100 Kg de peso.','Edo Laboratorios',58300,5,'https://colcagro.page.link/ZiHD','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-13 11:20:26','2021-10-13 11:23:35'),(36,262,'EDOMEKTINA Invermectina 1% 100ml - 500ml','INDICACIONES\n\nAntiparasitario de uso interno para el control de\nEcto y Endoparasitos, (ENDECTOCIDA) en\nBOVINOS Y PORCINOS, efectivo para el\ntratamiento y control de las formas adultas y\nlarvarias de nemátodos gastrointestinales\nincluyendo las formas inhibidas de Ostertagia\nostertagi, Cooperia sp, Haemonchus placei,\nOesophagostomum radiatum, Trichostrongylus\naxei, Trichostrongylus colubriformis. Estados\nadultos de Nematodirus helvetianus, Nematodirus\nspathiger, Strongyloides papillosus. Toxocara\nvitulorum, Dictyocaulus viviparus (parásito\npulmonar), Parafilaria bovicola, Thelazia spp,\nMetastrongylus sp. Parásitos externos: Nuche:\nDermatobia hominis; Piojos: Linognathus vituli,\nHaematopinus eurysternus, Solenopotes\ncapillatus. Ácaros de la sarna: Psoroptes\ncommunis var bovis, Sarcoptes scabiei var bovis,\nChorioptes bovis. Garrapatas: Rhipicephalus\nmicroplus.','Edo Laboratorios',41800,5,'https://colcagro.page.link/qBcx','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-13 11:27:49','2021-10-13 11:27:50'),(37,260,'EDUGLUCALFOS 500ml','INDICACIONES:\n\nEDO GLUCALFOS recomendado para el tratamiento de hipocalcemia, fiebre de leche y cetosis en Bovinos, Equinos, Porcinos, Ovinos y Caninos. Coadyuvante en estados de raquitismo y osteomalacia.\n\nOtras indicaciones a criterio del Médico Veterinario.\n\nPRECAUCIONES:\n\nConsulte al Médico Veterinario, manténgase fuera del alcance de los niños y de los animales domésticos. Consérvese en un lugar fresco.\n\nDOSIFICACIÓN:\n\nBOVINOS Y EQUINOS: 100 mL por cada 100 Kg de peso vivo.\n\nPORCINOS, OVINOS Y CANINOS: 50 mL por cada 50 Kg de peso vivo.\n\nEn todos los casos la frecuencia y duración del tratamiento depende del criterio del Médico Veterinario.\n\nVÍA DE ADMINISTRACIÓN:\n\nAplicar vía intravenosa, lentamente.','Edo Laboratorios',27000,5,'https://colcagro.page.link/5HK9','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-13 11:31:16','2021-10-13 11:31:28'),(38,260,'EDO -T6 Complejo B','INDICACIONES:\n\nEn todas las especies para el tratamiento de\nlas deficiencias de las vitaminas presentes en\nla formulación.\n\nDOSIFICACIÓN:\n\nVia de administración: Inyección intramuscular\nprofunda.\n1 mL por cada 20 Kg de peso.\n\nTodas las especies.\n\nDOSIS Y ESPECIES DE DESTINO:\nDosis Máxima por especie:\nBovinos y equinos: 20 mL\nTerneros y potros: 15 mL\nCerdos: 5 mL\nCabras y ovejas: 3 mL\nPerros: 2 mL\n\nGatos: 0,5 mL\n\nSeguir las instrucciones del Médico Veterinario.\n\nPRECAUCIONES:\n\nNo aplicar en equinos en la tabla del cuello.\nManténgase fuera del alcance de los niños y\nanimales domésticos.\nConsérvese en un lugar fresco\ny protegido de la luz.','Edo Laboratorios',57000,5,'https://colcagro.page.link/aTkj','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-13 11:33:59','2021-10-13 11:34:00'),(39,260,'EDO CALCITECH 500ml','INDICACIONES\n\nSuplemento alimenticio con base en calcio, fósforo y\nvitaminas para potros en desarrollo, caballos adultos,\nyeguas adultas, perros, gatos y terneros.\nSuministre Edo Calcitech de forma oral:\nEquinos: 10 mL por cada 100 Kg de peso vivo/día.\nPerros: 10 mL por cada 10 Kg de peso vivo/día.\nPorcinos: 120 mL por cada 30-40 Kg de peso vivo/día.\n\nGatos: 2 mL por cada Kg de peso vivo/día.\n\nTerneros: 120 mL por cada 40 Kg de peso vivo/día.\n\nINGREDIENTES\n\nFosfato Bicálcico, Vitamina D3, Vitamina A, Vitamina B1,\nVitamina B2, Vitamina B6, Vitamina B12, Nicotinamida,\nPreservantes, CMC Sódica, EDTA Disódica, Glicerina,\nSorbitol, Sacarina Sódica, Saborizantes, agua.','Edo Laboratorios',36850,5,'https://colcagro.page.link/WTcv','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-13 11:37:18','2021-10-13 11:37:18'),(40,264,'PANAMICINA L.A','COMPOSICIÓN: Cada ml contiene:\n\nOxitetraciclina (como dihidrato) Excipientes C.S.P.\n\n200 mg 1 ml\n\nPOSOLOGÍA:\n\nBovinos, Equinos, Porcinos, Caprinos, Caninos y gatos: 1 ml por cada 10 kg de peso vivo como dosis única.\n\nAves: 50 mg/kg (0,25 ml por kg de peso vivo).\n\nINDICACIONES:\n\nEn bovinos, equinos, porcinos, ovinos, caprinos, aves, caninos y gatos para el tratamiento de infecciones ocasionadas por: Anaplasma sp, Rickettsia sp, Escherichia coli, Pasteurella sp, Streptococcus sp, Haemophilus sp, Leptospira sp, Campylobacter sp. Listeria sp. y Pasteurella multocida.\n\nVÍA DE ADMINISTRACIÓN:\n\nIntramuscular. En lechones con pesos menores de 10 kg se recomienda la via subcutánea (detrás de la oreja) a dosis de 1 ml. En aves via subcutánea en la región posterior del cuello.\n\nTIEMPO DE RETIRO: Los animales tratados no deben\n\nsacrificarse para consumo humano hasta 21 días después de finalizado el tratamiento. No usar el producto en vacas en producción de leche. No administrar a aves en producción de huevos destinados al consumo humano.','Vicar',65000,5,'https://colcagro.page.link/vGsL','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-13 11:44:17','2021-10-13 11:44:17'),(41,264,'EDOMICINA 200 L.A. Oxcitetraciclina 20%','INDICACIONES\n\nEn bovinos, ovinos, caprinos y porcinos para el tratamiento de enfermedades infecciosas Streptococcus sp, Escherichia coli, Pasteurella sp. Haemophilus sp, Leptospira sp, Shigella sp. Campylobacter sp, Listeria sp.\n\nproducidas por Anaplasma sp, Rickettsia sp,\n\nDOSIS Y VÍA DE ADMINISTRACIÓN\n\nAplicar 1 mL/10 Kg de peso.\n\nSeguir las instrucciones del Médico Veterinario. Inyección intramuscular profunda','Edo Laboratorios',46200,5,'https://colcagro.page.link/wKcc','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-13 11:48:31','2021-10-13 11:48:31'),(42,273,'EDO SULFATO 30%  Trimetoprim Sulfa','INDICACIONES\n\nIndicado en bovinos, equinos, porcinos, perros y gatos\n\npara el tratamiento de enfermedades infecciosas de origen bacteriano, provocadas por Staphylococcus sp., Streptococcus sp., Trueperella pyogenes sp., Bordetella sp., Clostrydium sp y microorganismos Gram-negativos como Proteus sp., Salmonella... Pasteurella sp. y Klebsiella sp.; Por lo que se recomienda para infecciones de vias respiratorias, tubo\n\ndigestivo y vias urinarias. Util en coccidiosis en perros y gatos.\n\nDOSIS Y VIA DE ADMINISTRACIÓN\n\nAdministrar EDO SULFA 30% de acuerdo a las indicaciones del Médico Veterinario.\n\nSe recomienda: Bovinos: Via IM-IV lenta: 10 mL/100 Kg de peso\n\nque equivale a 30 mg/Kg de peso. Equinos: Via IM-IV lenta (minimo 1 minuto): 5 mL/\n\n100 Kg de peso que equivale a 15 mg/Kg de peso. Porcinos: Via IM: 4mL/25 Kg de peso que equivale a 48mg/Kg de peso.\n\nGatos: Via IV-SC: 1mL/10 Kg de peso que equivale a 30mg/Kg de peso.','Edo Laboratorios',30000,5,'https://colcagro.page.link/P8cW','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-13 11:51:52','2021-10-13 11:51:53'),(43,264,'EDOTYLOSINA Tilosina 20%','INDICACIONES\n\nEn bovinos, ovinos, caprinos y porcinos para el\n\npyogenes, Pasteurella multocida,\n\ntratamiento de infecciones ocasionadas por Trueperella Streptococcus sp., Staphylococcus sp., Fusobacterium necrophorum,\n\nErysipelothrix rhusiopathiae, Campylobacter Serpulina hyodysenteriae.\n\nDOSIFICACIÓN\n\nA criterio del Médico Veterinario.\n\nVIA DE ADMINISTRACIÓN Inyección Intramuscular Profunda.','Edo Laboratorios',22500,5,'https://colcagro.page.link/Tupy','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-13 11:54:05','2021-10-13 11:54:05'),(44,264,'Edo Penicilina Triple 6:3:3','Antibiótico Penicilina G Benzatínica Penicilina G Procránica Penicilina G Potásica.   INDICACIONES: indicada en bovinos, ,equinos, porcinos, Ovinos caprinos, caninos y gatos; para el tratamiento de infecciones producidas por microorganismos sensibles a la Penicilina.','Edo Laboratorios',24500,5,'https://colcagro.page.link/pXPd','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-13 11:58:34','2021-10-13 11:58:34'),(45,273,'EDODIUREX Furosemida 5%','INDICACIONES\n\nEdo-DIUREX, està indicado en bovinos, equinos, caninos y gatos como coadyuvante en el tratamiento de edemas a nivel prepucial y del escroto, edemas caquécticos parasitario, edema de extremidades y en el edema fisiopatológico de la ubre. En casos de ascitis y como coadyuvante en la eliminación de liquidos tisulares y cavitarios.\n\nDOSIS Y VÍA DE ADMINISTRACIÓN\n\nAdministrar por vía I.M/I.V Bovinos y Equinos 1 a 2 mL/100 Kg de peso que equivale a 0,5-1,0 mg/Kg de peso. Perros y Gatos 0,5 mL /20Kg de peso que equivale a 1,25 mg/Kg de peso. Frecuencia y duración del Tratamiento. A criterio del Médico Veterinario','Edo Laboratorios',27000,5,'https://colcagro.page.link/UZaA','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-13 12:04:35','2021-10-13 12:04:35'),(46,265,'EDOFLUNIX Flunixin Meglumina','INDICACIONES\n\nEN EQUINOS: Para aliviar el dolor y la inflamación asociados con desórdenes músculo esqueléticos y el dolor visceral asociado a cólicos.\n\nEN BOVINOS: Para el control de la inflamación aguda asociada con enfermedad respiratoria y coadyuvante en el tratamiento de mastitis aguda.\n\nEN PORCINOS: Coadyuvante en el tratamiento de enfermedad respiratoria aguda.\n\nDOSIFICACIÓN\n\nEQUINOS: 2,2 mL por cada 100 Kg de peso. IM o IV.\n\nBOVINOS: 4,4 mL por cada 100 Kg de peso. IVO IMO Subcutánea. PORCINOS: 2,2 mL por cada 50 Kg de peso. Inyección IM profunda.','Edo Laboratorios',56000,5,'https://colcagro.page.link/dkJt','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-14 11:20:06','2021-10-14 11:20:07'),(47,265,'EDODIPIRONA Dipirona 50%','INDICACIONES\n\ncomo analgésico antiespasmódico, antipiretico\n\nEn equinos, bovinos, ovinos, caprinos, porcinos y caninos antiinflamatorio. En equinos como coadyuvante en el tratamiento del cólico y episodios de dolor.\n\nVÍA DE ADMINISTRACIÓN\n\nInyección intramuscular o intravenosa lenta.\n\nDOSIS Y ESPECIES DE DESTINO\n\nA criterio del Médico Veterinario. Bovinos y Equinos: 6 mL/100 Kg de peso que equivale a 30mg /Kg de peso IM-IV cada 8 horas.\n\nOvinos, Caprinos y Porcinos: 2mL/25Kg de peso que equivale a 40mg/Kg de peso IM-IV cada 12 horas. Perros: 0,5mL/10 Kg de peso que equivale a 25mg/Kg de peso IM-IV cada 8 horas.\n\nCuando se administra por via intramuscular, las dosis máximas por sitio de inyección son las siguientes: en bovinos 29 mL, porcinos 20 mL. equinos 20 ml, ovinos y caprinos 10 mL y perros 3 mL. En porcinos, cuando el volumen de la administración supere los 20 mL se deberá aplicar en al menos dos lugares de inyección.','Edo Laboratorios',27000,5,'https://colcagro.page.link/SHzb','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-14 11:22:47','2021-10-14 11:22:47'),(48,260,'EDO COZINK Cobre - Zinc - Calcio - Potasio 250ml o 50ml','INDICACIONES:\n\nCoadyuvante en el tratamiento de las deficiencias de los elementos que entran en la composición.\n\nDOSIFICACIÓN:\n\nInyección intramuscular profunda En equinos se recomienda utilizar via IV mezclado con solución salina o solución Hartmann\n\nBOVINOS, EQUINOS, PORCINOS, OVINOS Y CANINOS:\n\n1 mL por cada 20 Kg de peso. DOSIS MÁXIMA: 20 mL.\n\nSeguir las instrucciones del Médico Veterinario.','Edo Laboratorios',53600,5,'https://colcagro.page.link/fuFG','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-14 11:26:02','2021-10-14 11:26:03'),(49,260,'EDOMODIFOR Vitaminas - Minerales - Aminoácidos','INDICACIONES:\n\nÚtil para el tratamiento de las deficiencias de las Vitaminas y demás elementos que entran en la composición.\n\nOtras indicaciones a criterio del Médico Veterinario.\n\nFrecuencia y duración del tratamiento: A criterio del Médico Veterinario.\n\nDOSIFICACIÓN:\n\nInyección intramuscular profunda\n\nTerneros y Potros 5 mL Bovinos y Equinos adultos 10 mL Caprinos y Ovinos 5 mL Cerdos 1 mL/10 Kg de peso Perros, Gatos 1 mL / 5 Kg de peso\n\nSeguir las indicaciones del Médico Veterinario.','Edo Laboratorios',66000,5,'https://colcagro.page.link/zPNg','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-14 11:28:37','2021-10-14 11:28:37'),(50,272,'EDO F-32 Fósforo Oligoelementos','INDICACIONES:\n\nCoadyuvante en el tratamiento por carencia de Fósforo y los microelementos que entran en la composición.\n\nDOSIFICACIÓN:\n\nInyección intramuscular profunda 1 mL por cada 20 kilos de peso.\n\nBOVINOS ADULTOS Máx. 20 mL TERNEROS Máx. 10 mL CAPRINOS, OVINOS Y PORCINOS: Máx. 5 mL\n\nSeguir las indicaciones del\n\nMédico Veterinario.','Edo Laboratorios',82000,5,'https://colcagro.page.link/3YwD','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-14 11:31:03','2021-10-14 11:31:04'),(51,262,'EDO EKINA Invermectina 2% + Praziquantel 15%','Antiparasitario de amplio espectro efectivo para el tratamiento y control de parasitosis causadas por nematodos, cestodos y parásitos externos comunes en caballos. Oral únicamente.\n\nIndicaciones\n\nEn equinos para el tratamiento y control de: Strongylus vulgaris, S. edentatus, S. equinus, Trichostrongylus axei, Habronema sp, Draschia sp, Parascaris equorum, Strongyloides sp, Oxyuris sp, Triodontophorus sp, Cyathostomum sp Cylicocyclus sp, Cylicodontophorus sp, Cylicostephanus sp, Gyalocephalus, Dictyocaulus arnfieldi, Anoplocephala (perfoliata, magna, mamillana), Onchocerca sp, Gasterophilus sp.','Edo Laboratorios',10500,5,'https://colcagro.page.link/FCtp','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-14 11:35:04','2021-10-14 11:35:05'),(52,262,'EDO MEKTINA Invetmectina gold 3.15% Antiparasitario de larga acción.','Función\n\nAntiparasitario de amplio espectro y larga acción para el control de Ecto y Endoparásitos en bovinos. \nIndicaciones\n\nAntiparasitario de acción prolongada para Bovinos, indicado para el tratamiento y control de Ecto y Endoparásitos.\nParásitos Gastrointestinales: Ostertagia ostertagi, incluye forma inhibida; Cooperia sp. Haemonchus placei, Oesophagostomum radiatum, Trichostrongylus axei, Trichostrongylus colubriformes, formas adultas de Nematodirus helvetianus; Strongyloides papillosus, Toxocara vitulorum. Parásitos Pulmonares: Formas Larvaria, adulta e inhibida de Dictyocaulus viviparus, Parafilaria bovicola, Thelazia sp.\nNuche (Dermatobia hominis) Piojos (Linognathus vituli, Solenoptes capillatus) ayuda al control de Ácaros de la sarna (Psoroptes comuni var bovis, Sarcoptes scabiei var bovis, Chorioptes bovis) y Garrapata (Boophilus microplus).\n\nDosis:\n\n1 mL / 50 Kg de peso que equivale a 630 microgramos de Ivermectina  por Kg de peso vivo.\nSe recomienda usar equipo estéril y procedimientos asépticos.','Edo Laboratorios',76000,5,'https://colcagro.page.link/hRJ4','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-14 11:39:20','2021-10-14 11:39:21'),(53,262,'EDO RICOBENDAZOL Antiheltamínico Albendazol Sulfóxido 17.5%','Función:\n\nEndo parasiticida de amplio espectro para bovinos, con efecto larvicida, adulticida y ovicida.\nDosis:\n\n2 mL de Edo-Ricobendazol por cada 100 kg de peso.\nPara el tratamiento del parasitismo ocasionado por Fasciola hepática administrar 4 mL por cada 100 Kg de peso que equivale a 7 mg de Albendazol sulfoxido por/Kg de peso.\n\nVía de Administración / Modo de Uso:\n\n￼Inyección subcutánea, en la piel floja por delante o por detrás de la articulación escápulo-humeral.\n\nIndicaciones\n\nEn bovinos para el control y tratamiento del parasitismo ocasionado por : Nemátodos Gastrointestinales: Trichostrongylus sp., Haemonchus sp., Cooperia sp., Ostertagia sp., Oesophagostomum sp., Bunostomum phlebotomum, Strongyloides sp., Nematodirus sp. Nemátodos pulmonares: Dictyocaulus sp. Tremátodos: Fasciola hepática (adultos).','Edo Laboratorios',82500,5,'https://colcagro.page.link/Zuqn','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-14 11:42:44','2021-10-14 11:42:45'),(54,273,'EDO MIL-B Complejo B + Calcio 500ml o 250ml','Mil B es un reconstituyente que actúa en el metabolismo y estimula el apetito. Es ideal en la recuperación de enfermedades hemoparasitarias (fiebre de garrapatas). Mejora las ganancias de peso y crecimiento. Ayuda en la formación de glóbulos rojos (Antianémico).profunda.\n\nIndicaciones\n\nCoadyuvante en el tratamiento de las deficiencias de las vitaminas del Complejo B y de los elementos que entran en la composición.\n\nDosis:\n\nBovinos y Equinos: 1 mL por cada 40 Kg de peso.\nOvinos y Porcinos: 1 mL por cada 25 Kg de peso.\nCaninos: 1 mL por cada 30 Kg de peso.','Edo Laboratorios',66000,5,'https://colcagro.page.link/RAq6','2022-01-05 12:04:32','-72.4008473','5.3488144',378,1,'2021-10-14 11:46:00','2021-10-14 11:46:01'),(55,273,'Seguro Bovino y Bufalino','Asegura el bienestar de cada animal existente en tu hato ante cualquier enfermedad (establecidas dentro del condicionado), la ocurrencia de algún evento climático, o accidentes que diezmen el número de bovinos o búfalos a tu cuidado, así evitarás la pérdida considerable de una buena producción.','Sura',200,9,'https://colcagro.page.link/4vKL','2021-11-19 16:10:19','-72.4021634','5.3479845',378,2,'2021-10-19 16:16:02','2021-10-20 11:32:58'),(56,259,'¿Necesitas capital de trabajo?','¿Eres un exportador de frescos? Podemos apoyarte en la busqueda de financiamiento precosecha. Consulta tu nosotros la viabilidad de  la linea de capital','Growbank',1000,25,'https://colcagro.page.link/vuPm','2022-11-22 11:19:11','-72.4021365','5.3479751',378,2,'2021-11-22 11:27:50','2021-12-14 10:25:06'),(57,105,'Sistemas de bombeo solar','Nuestros sistemas de bombeo permiten llevar agua desde un río, caño, pozo, entre otros, a un punto de aprovechamiento, utilizando paneles solares que producen energía eléctrica a través del sol para abastecer la energía requerida por los motores de las bombas hidráulicas de manera confiable, económica y amigable con el medio ambiente.','Eeis',1000,27,'https://colcagro.page.link/nYU3','2021-12-13 08:14:53','-75.6119514','6.1707690',12,1,'2021-11-23 23:09:44','2021-11-24 08:25:10'),(58,109,'Sistemas solares conectados a la red','Genera energía a través del sol de manera constante, para abastecer el total de tu consumo o una parte de él. Este sistema se instalará en tu techo o cerca de tu hogar y se conecta a la red convencional para dar respaldo, además te permitirá conectarte a cualquier tipo de equipo o electrodoméstico.','Eeis',1,27,'https://colcagro.page.link/Uo2e','2021-12-13 08:14:53','-75.6119514','6.1707690',12,1,'2021-11-23 23:11:22','2021-11-24 08:27:09'),(59,109,'Sistemas solares no conectados a la red','Si vives en un lugar apartado donde la energía es intermitente, o deseas tener un respaldo para abastecer tu consumo, este sistema te permitirá generar energía constante a través del sol, almacenada en baterías para que alimentes tus equipos o electrodomésticos durante el día y la noche.','Eeis',1,27,'https://colcagro.page.link/VH4F','2021-12-13 08:14:53','-75.6119514','6.1707690',12,1,'2021-11-23 23:12:19','2021-11-24 08:28:28'),(60,131,'Aceite de palo (copaifera pubiflora)','Aceite ancestral, potente cicatrizante y cauterizante  de uso humano y veterinario','Vita',50000,15,'https://colcagro.page.link/tTPc','2021-12-06 15:35:31','-72.3903164','5.3381467',378,1,'2021-12-01 21:14